hode(stroker)\\s|sperm|semen|hooker\\s|prostitute\\s|pubic( |)hair|boner\\s|chode\\s)(?!\\w)\";\r\n\r\n/* Not for autoconfirmed */\r\n(!(\"autoconfirmed\" in user_groups))\r\n\r\n/* prevent filtered words from being added to text */\r\n&(((lcase(added_lines) rlike filter2) | (lcase(added_lines) rlike filter2)\r\n& !((lcase(removed_lines) rlike filter2) | (lcase(removed_lines) rlike filter2)))\r\n\r\n/* prevent articles from being created which contain filtered words */\r\n| (article_recent_contributors==\"\"  & ((lcase(article_text) rlike filter2) | (lcase(article_text) rlike filter2))\r\n\r\n/* prevent summaries containing such words */\r\n| lcase(summary) rlike filter2 | lcase(summary) rlike filter2)\r\n\r\n/* prevent page moves to titles containing filtered words */\r\n| (action==\"move\" & ((lcase(moved_to_text) rlike filter2) | (lcase(moved_to_text) rlike filter2)))\r\n\r\n/* prevent user accounts from being created which contain filtered words */\r\n| (action==\"createaccount\" & ((lcase(user_name) rlike filter2) | (lcase(user_name) rlike filter2))))\r\n\r\n/* allow action if the word was there before for some reason */\r\n& !((lcase(removed_lines) rlike filter2) | (lcase(removed_lines) rlike filter2))',1,'WikiAdmin','20231219171453',1,'','Common profanity',0,0,0,0,'disallow,tag',0,'default',1);
