 | lcase(summary) rlike filter2)\r\n\r\n/* prevent page moves to titles containing filtered words */\r\n| (action==\"move\" & ((lcase(moved_to_text) rlike filter2) | (lcase(moved_to_text) rlike filter2)))\r\n\r\n/* prevent user accounts from being created which contain filtered words */\r\n| (action==\"createaccount\" & ((lcase(user_name) rlike filter2) | (lcase(user_name) rlike filter2))))\r\n\r\n/* allow action if the word was there before for some reason */\r\n& !((lcase(removed_lines) rlike filter2) | (lcase(removed_lines) rlike filter2))','','enabled','Common profanity','a:2:{s:4:\"warn\";a:1:{i:0;s:19:\"abusefilter-warning\";}s:3:\"tag\";a:1:{i:0;s:16:\"common profanity\";}}',0,'af_public_comments,af_pattern,af_group,actions','default',1),(11,4,1,'WikiAdmin','20231219171159','page_namespace % 2 == 1 &\r\nuser_editcount < 12 &\r\nnew_size < 100 &\r\nold_size > 150 &\r\n!(user_name in page_prefixedtitle) &\r\npage_namespace != 3 &\r\n!(added_lines irlike \"^#\\s*redirect\\s*\\[\\[\")','','enabled','Talk page blanking by unregistered/new user','a:2:{s:4:\"warn\";a:1:{i:0;s:19:\"abusefilter-warning\";}s:3:\"tag\";a:1:{i:0;s:18:\"talk page blanking\";}}',0,'actions','default',1),(12,5,1,'WikiAdmin','20231219171234','! \"confirmed\" in user_groups &\r\npage_namespace == 0 &\r\nold_size > 0 &\r\nrcount(\"https?:\\/\\/\", added_lines) > rcount(\"https?:\\/\\/\", removed_lines) &\r\ncount(\"<ref\", added_lines) <= count(\"<ref\",  removed_lines) &\r\n! user_name in page_recent_contributors','','enabled','Link spamming','a:3:{s:8:\"throttle\";a:3:{i:0;i:5;i:1;s:6:\"3,1200\";i:2;s:4:\"user\";}s:4:\"warn\";a:1:{i:0;s:19:\"abusefilter-warning\";}s:3:\"tag\";a:1:{i:0;s:18:\"possible link spam\";}}',0,'actions','default',1),(13,8,1,'WikiAdmin','20231219171353','/* Not autoconfirmed */\r\n! (\"autoconfirmed\" in user_groups)\r\n\r\n/* User added something */\r\n& length(added_lines) > 1\r\n\r\n/* Redirect in caps is alright */\r\n&  !\"#REDIRECT\" in added_lines\r\n\r\n/* Det