 of information to include:\";'),('en','messages:apihelp-query+alllinks-param-to','s:48:\"en:The title of the link to stop enumerating at.\";'),('en','messages:apihelp-query+alllinks-param-unique','s:150:\"en:Only show distinct linked titles. Cannot be used with <kbd>$1prop=ids</kbd>.\nWhen used as a generator, yields target pages instead of source pages.\";'),('en','messages:apihelp-query+alllinks-paramvalue-prop-ids','s:82:\"en:Adds the page ID of the linking page (cannot be used with <var>$1unique</var>).\";'),('en','messages:apihelp-query+alllinks-paramvalue-prop-title','s:30:\"en:Adds the title of the link.\";'),('en','messages:apihelp-query+alllinks-summary','s:55:\"en:Enumerate all links that point to a given namespace.\";'),('en','messages:apihelp-query+allmessages-example-de','s:69:\"en:Show messages <kbd>august</kbd> and <kbd>mainpage</kbd> in German.\";'),('en','messages:apihelp-query+allmessages-example-ipb','s:47:\"en:Show messages starting with <kbd>ipb-</kbd>.\";'),('en','messages:apihelp-query+allmessages-param-args','s:44:\"en:Arguments to be substituted into message.\";'),('en','messages:apihelp-query+allmessages-param-customised','s:52:\"en:Return only messages in this customisation state.\";'),('en','messages:apihelp-query+allmessages-param-enableparser','s:114:\"en:Set to enable parser, will preprocess the wikitext of message (substitute magic words, handle templates, etc.).\";'),('en','messages:apihelp-query+allmessages-param-filter','s:60:\"en:Return only messages with names that contain this string.\";'),('en','messages:apihelp-query+allmessages-param-from','s:44:\"en:Return messages starting at this message.\";'),('en','messages:apihelp-query+allmessages-param-includelocal','s:276:\"en:Also include local messages, i.e. messages that don\'t exist in the software but do exist as in the {{ns:MediaWiki}} namespace.\nThis lists all {{ns:MediaWiki}}-namespace pages, so it will also list those that aren\'t really messages such as [[MediaWiki:Common.js|Common.js]].\";'),('en','messages:apihelp-query+allmessages-param-lang','s:36:\"en:Return messages in this language.\";'),('en','messages:apihelp-query+allmessages-param-messages','s:71:\"en:Which messages to output. <kbd>*</kbd> (default) means all messages.\";'),('en','messages:apihelp-query+allmessages-param-nocontent','s:68:\"en:If set, do not include the content of the messages in the output.\";'),('en','messages:apihelp-query+allmessages-param-prefix','s:36:\"en:Return messages with this prefix.\";'),('en','messages:apihelp-query+allmessages-param-prop','s:27:\"en:Which properties to get.\";'),('en','messages:apihelp-query+allmessages-param-title','s:80:\"en:Page name to use as context when parsing message (for $1enableparser option).\";'),('en','messages:apihelp-query+allmessages-param-to','s:42:\"en:Return messages ending at this message.\";'),('en','messages:apihelp-query+allmessages-summary','s:34:\"en:Return messages from this site.\";'),('en','messages:apihelp-query+allpages-example-b','s:60:\"en:Show a list of pages starting at the letter <kbd>B</kbd>.\";'),('en','messages:apihelp-query+allpages-example-generator','s:63:\"en:Show info about 4 pages starting at the letter <kbd>T</kbd>.\";'),('en','messages:apihelp-query+allpages-example-generator-revisions','s:73:\"en:Show content of first 2 non-redirect pages beginning at <kbd>Re</kbd>.\";'),('en','messages:apihelp-query+allpages-param-dir','s:34:\"en:The direction in which to list.\";'),('en','messages:apihelp-query+allpages-param-filterlanglinks','s:111:\"en:Filter based on whether a page has langlinks. Note that this may not consider langlinks added by extensions.\";'),('en','messages:apihelp-query+allpages-param-filterredir','s:23:\"en:Which pages to list.\";'),('en','messages:apihelp-query+allpages-param-from','s:44:\"en:The page title to start enumerating from.\";'),('en','messages:apihelp-query+allpages-param-limit','s:34:\"en:How many total pages to return.\";'),('en','messages:apihelp-query