l transcluded titles that begin with this value.\";'),('en','messages:apihelp-query+alltransclusions-param-prop','s:42:\"en:Which pieces of information to include:\";'),('en','messages:apihelp-query+alltransclusions-param-to','s:56:\"en:The title of the transclusion to stop enumerating at.\";'),('en','messages:apihelp-query+alltransclusions-param-unique','s:144:\"en:Only show distinct transcluded titles. Cannot be used with $1prop=ids.\nWhen used as a generator, yields target pages instead of source pages.\";'),('en','messages:apihelp-query+alltransclusions-paramvalue-prop-ids','s:76:\"en:Adds the page ID of the transcluding page (cannot be used with $1unique).\";'),('en','messages:apihelp-query+alltransclusions-paramvalue-prop-title','s:38:\"en:Adds the title of the transclusion.\";'),('en','messages:apihelp-query+alltransclusions-summary','s:99:\"en:List all transclusions (pages embedded using &#123;&#123;x&#125;&#125;), including non-existing.\";'),('en','messages:apihelp-query+allusers-example-y','s:39:\"en:List users starting at <kbd>Y</kbd>.\";'),('en','messages:apihelp-query+allusers-param-activeusers','s:64:\"en:Only list users active in the last $1 {{PLURAL:$1|day|days}}.\";'),('en','messages:apihelp-query+allusers-param-attachedwiki','s:117:\"en:With <kbd>$1prop=centralids</kbd>, also indicate whether the user is attached with the wiki identified by this ID.\";'),('en','messages:apihelp-query+allusers-param-dir','s:24:\"en:Direction to sort in.\";'),('en','messages:apihelp-query+allusers-param-excludegroup','s:37:\"en:Exclude users in the given groups.\";'),('en','messages:apihelp-query+allusers-param-from','s:42:\"en:The username to start enumerating from.\";'),('en','messages:apihelp-query+allusers-param-group','s:124:\"en:Only include users in the given groups. Does not include implicit or auto-promoted groups like *, user, or autoconfirmed.\";'),('en','messages:apihelp-query+allusers-param-limit','s:38:\"en:How many total usernames to return.\";'),('en','messages:apihelp-query+allusers-param-prefix','s:51:\"en:Search for all users that begin with this value.\";'),('en','messages:apihelp-query+allusers-param-prop','s:42:\"en:Which pieces of information to include:\";'),('en','messages:apihelp-query+allusers-param-rights','s:144:\"en:Only include users with the given rights. Does not include rights granted by implicit or auto-promoted groups like *, user, or autoconfirmed.\";'),('en','messages:apihelp-query+allusers-param-to','s:39:\"en:The username to stop enumerating at.\";'),('en','messages:apihelp-query+allusers-param-witheditsonly','s:39:\"en:Only list users who have made edits.\";'),('en','messages:apihelp-query+allusers-paramvalue-prop-blockinfo','s:58:\"en:Adds the information about a current block on the user.\";'),('en','messages:apihelp-query+allusers-paramvalue-prop-centralids','s:59:\"en:Adds the central IDs and attachment status for the user.\";'),('en','messages:apihelp-query+allusers-paramvalue-prop-editcount','s:35:\"en:Adds the edit count of the user.\";'),('en','messages:apihelp-query+allusers-paramvalue-prop-groups','s:113:\"en:Lists groups that the user is in. This uses more server resources and may return fewer results than the limit.\";'),('en','messages:apihelp-query+allusers-paramvalue-prop-implicitgroups','s:53:\"en:Lists all the groups the user is automatically in.\";'),('en','messages:apihelp-query+allusers-paramvalue-prop-registration','s:78:\"en:Adds the timestamp of when the user registered if available (may be blank).\";'),('en','messages:apihelp-query+allusers-paramvalue-prop-rights','s:34:\"en:Lists rights that the user has.\";'),('en','messages:apihelp-query+allusers-summary','s:34:\"en:Enumerate all registered users.\";'),('en','messages:apihelp-query+authmanagerinfo-example-login','s:62:\"en:Fetch the requests that may be used when beginning a login.\";'),('en','messages:apihelp-query+authmanagerinfo-example-login-merged','s:87:\"en:Fetch the requests that may be used when beginning a login, with form fields merged.\";'),('en','messages:apihelp-query+authmanagerinfo-example-securitysensitiveoperation','s:71:\"en:Test whether authentication is sufficient for action <kbd>foo</kbd>.\";'),('en','messages:apihelp-query+authmanagerinfo-param-requestsfor','s:102:\"en:Fetch information about the authentication requests needed for the specified authentication action.\";'),('en','messages:apihelp-query+authmanagerinfo-param-securitysensitiveoperation','s:118:\"en:Test whether the user\'s current authentication status is sufficient for the specified security-sensitive operation.\";'),('en','messages:apihelp-query+authmanagerinfo-summary','s:64:\"en:Retrieve information about the current authentication status.\";'),('en','messages:apihelp-query+backlinks-example-generator','s:69:\"en:Get information about pages linking to [[{{MediaWiki:Mainpage}}]].\";'),('en','messages:apihelp-query+backlinks-example-simple','s:44:\"en:Show links to [[{{MediaWiki:Mainpage}}]].\";'),('en','messages:apihelp-query+backlinks-param-dir','s:34:\"en:The direction in which to list.\";'),('en','messages:apihelp-query+backlinks-param-filterredir','s:146:\"en:How to filter for redirects. If set to <kbd>nonredirects</kbd> when <var>$1redirect</var> is enabled, this is only applied to the second level.\";'),('en','messages:apihelp-query+backlinks-param-limit','s:182:\"en:How many total pages to return. If <var>$1redirect</var> is enabled, the limit applies to each level separately (which means up to 2 * <var>$1limit</var> results may be returned).\";'),('en','messages:apihelp-query+backlinks-param-namespace','s:30:\"en:The namespace to enumerate.\";'),('en','messages:apihelp-query+backlinks-param-pageid','s:70:\"en:Page ID to search. Cannot be used together with <var>$1title</var>.\";'),('en','messages:apihelp-query+backlinks-param-redirect','s:109:\"en:If linking page is a redirect, find all pages that link to that redirect as well. Maximum limit is halved.\";'),('en','messages:apihelp-query+backlinks-param-title','s:69:\"en:Title to search. Cannot be used together with <var>$1pageid</var>.\";'),('en','messages:apihelp-query+backlinks-summary','s:46:\"en:Find all pages that link to the given page.\";'),('en','messages:apihelp-query+blocks-example-simple','s:15:\"en:List blocks.\";'),('en','messages:apihelp-query+blocks-example-users','s:60:\"en:List blocks of users <kbd>Alice</kbd> and <kbd>Bob</kbd>.\";'),('en','messages:apihelp-query+blocks-param-end','s:40:\"en:The timestamp to stop enumerating at.\";'),('en','messages:apihelp-query+blocks-param-ids','s:40:\"en:List of block IDs to list (optional).\";'),('en','messages:apihelp-query+blocks-param-ip','s:195:\"en:Get all blocks applying to this IP address or CIDR range, including range blocks.\nCannot be used together with <var>$3users</var>. CIDR ranges broader than IPv4/$1 or IPv6/$2 are not accepted.\";'),('en','messages:apihelp-query+blocks-param-limit','s:40:\"en:The maximum number of blocks to list.\";'),('en','messages:apihelp-query+blocks-param-prop','s:27:\"en:Which properties to get:\";'),('en','messages:apihelp-query+blocks-param-show','s:136:\"en:Show only items that meet these criteria.\nFor example, to see only indefinite blocks on IP addresses, set <kbd>$1show=ip|!temp</kbd>.\";'),('en','messages:apihelp-query+blocks-param-start','s:43:\"en:The timestamp to start enumerating from.\";'),('en','messages:apihelp-query+blocks-param-users','s:42:\"en:List of users to search for (optional).\";'),('en','messages:apihelp-query+blocks-paramvalue-prop-by','s:42:\"en:Adds the username of the blocking user.\";'),('en','messages:apihelp-query+blocks-paramvalue-prop-byid','s:41:\"en:Adds the user ID of the blocking user.\";'),('en','messages:apihelp-query+blocks-paramvalue-prop-expiry','s:48:\"en:Adds the timestamp of when the block expires.\";'),('en','messages:apihelp-query+blocks-paramvalue-prop-flags','s:49:\"en:Tags the ban with (autoblock, anononly, etc.).\";'),('en','messages:apihelp-query+blocks-paramvalue-prop-id','s:28:\"en:Adds the ID of the block.\";'),('en','messages:apihelp-query+blocks-paramvalue-prop-range','s:56:\"en:Adds the range of IP addresses affected by the block.\";'),('en','messages:apihelp-query+blocks-paramvalue-prop-reason','s:39:\"en:Adds the reason given for the block.\";'),('en','messages:apihelp-query+blocks-paramvalue-prop-restrictions','s:68:\"en:Adds the partial block restrictions if the block is not sitewide.\";'),('en','messages:apihelp-query+blocks-paramvalue-prop-timestamp','s:50:\"en:Adds the timestamp of when the block was given.\";'),('en','messages:apihelp-query+blocks-paramvalue-prop-user','s:41:\"en:Adds the username of the blocked user.\";'),('en','messages:apihelp-query+blocks-paramvalue-prop-userid','s:40:\"en:Adds the user ID of the blocked user.\";'),('en','messages:apihelp-query+blocks-summary','s:43:\"en:List all blocked users and IP addresses.\";'),('en','messages:apihelp-query+categories-example-generator','s:84:\"en:Get information about all categories used in the page <kbd>Albert Einstein</kbd>.\";'),('en','messages:apihelp-query+categories-example-simple','s:75:\"en:Get a list of categories the page <kbd>Albert Einstein</kbd> belongs to.\";'),('en','messages:apihelp-query+categories-param-categories','s:99:\"en:Only list these categories. Useful for checking whether a certain page is in a certain category.\";'),('en','messages:apihelp-query+categories-param-dir','s:34:\"en:The direction in which to list.\";'),('en','messages:apihelp-query+categories-param-limit','s:33:\"en:How many categories to return.\";'),('en','messages:apihelp-query+categories-param-prop','s:56:\"en:Which additional properties to get for each category:\";'),('en','messages:apihelp-query+categories-param-show','s:36:\"en:Which kind of categories to show.\";'),('en','messages:apihelp-query+categories-paramvalue-prop-hidden','s:75:\"en:Tags categories that are hidden with <code>_&#95;HIDDENCAT_&#95;</code>.\";'),('en','messages:apihelp-query+categories-paramvalue-prop-sortkey','s:99:\"en:Adds the sortkey (hexadecimal string) and sortkey prefix (human-readable part) for the category.\";'),('en','messages:apihelp-query+categories-paramvalue-prop-timestamp','s:49:\"en:Adds timestamp of when the category was added.\";'),('en','messages:apihelp-query+categories-summary','s:43:\"en:List all categories the pages belong to.\";'),('en','messages:apihelp-query+categoryinfo-example-simple','s:77:\"en:Get information about <kbd>Category:Foo</kbd> and <kbd>Category:Bar</kbd>.\";'),('en','messages:apihelp-query+categoryinfo-summary','s:50:\"en:Returns information about the given categories.\";'),('en','messages:apihelp-query+categorymembers-example-generator','s:69:\"en:Get page info about first 10 pages in <kbd>Category:Physics</kbd>.\";'),('en','messages:apihelp-query+categorymembers-example-simple','s:53:\"en:Get first 10 pages in <kbd>Category:Physics</kbd>.\";'),('en','messages:apihelp-query+categorymembers-param-dir','s:30:\"en:In which direction to sort.\";'),('en','messages:apihelp-query+categorymembers-param-end','s:82:\"en:Timestamp to end listing at. Can only be used with <kbd>$1sort=timestamp</kbd>.\";'),('en','messages:apihelp-query+categorymembers-param-endhexsortkey','s:120:\"en:Sortkey to end listing at, as returned by <kbd>$1prop=sortkey</kbd>. Can only be used with <kbd>$1sort=sortkey</kbd>.\";'),('en','messages:apihelp-query+categorymembers-param-endsortkey','s:31:\"en:Use $1endhexsortkey instead.\";'),('en','messages:apihelp-query+categorymembers-param-endsortkeyprefix','s:195:\"en:Sortkey prefix to end listing <strong>before</strong> (not <strong>at</strong>; if this value occurs it will not be included!). Can only be used with $1sort=sortkey. Overrides $1endhexsortkey.\";'),('en','messages:apihelp-query+categorymembers-param-limit','s:41:\"en:The maximum number of pages to return.\";'),('en','messages:apihelp-query+categorymembers-param-namespace','s:169:\"en:Only include pages in these namespaces. Note that <kbd>$1type=subcat</kbd> or <kbd>$1type=file</kbd> may be used instead of <kbd>$1namespace=14</kbd> or <kbd>6</kbd>.\";'),('en','messages:apihelp-query+categorymembers-param-pageid','s:89:\"en:Page ID of the category to enumerate. Cannot be used together with <var>$1title</var>.\";'),('en','messages:apihelp-query+categorymembers-param-prop','s:42:\"en:Which pieces of information to include:\";'),('en','messages:apihelp-query+categorymembers-param-sort','s:23:\"en:Property to sort by.\";'),('en','messages:apihelp-query+categorymembers-param-start','s:86:\"en:Timestamp to start listing from. Can only be used with <kbd>$1sort=timestamp</kbd>.\";'),('en','messages:apihelp-query+categorymembers-param-starthexsortkey','s:124:\"en:Sortkey to start listing from, as returned by <kbd>$1prop=sortkey</kbd>. Can only be used with <kbd>$1sort=sortkey</kbd>.\";'),('en','messages:apihelp-query+categorymembers-param-startsortkey','s:33:\"en:Use $1starthexsortkey instead.\";'),('en','messages:apihelp-query+categorymembers-param-startsortkeyprefix','s:129:\"en:Sortkey prefix to start listing from. Can only be used with <kbd>$1sort=sortkey</kbd>. Overrides <var>$1starthexsortkey</var>.\";'),('en','messages:apihelp-query+categorymembers-param-title','s:145:\"en:Which category to enumerate (required). Must include the <kbd>{{ns:category}}:</kbd> prefix. Cannot be used together with <var>$1pageid</var>.\";'),('en','messages:apihelp-query+categorymembers-param-type','s:94:\"en:Which type of category members to include. Ignored when <kbd>$1sort=timestamp</kbd> is set.\";'),('en','messages:apihelp-query+categorymembers-paramvalue-prop-ids','s:20:\"en:Adds the page ID.\";'),('en','messages:apihelp-query+categorymembers-paramvalue-prop-sortkey','s:74:\"en:Adds the sortkey used for sorting in the category (hexadecimal string).\";'),('en','messages:apihelp-query+categorymembers-paramvalue-prop-sortkeyprefix','s:97:\"en:Adds the sortkey prefix used for sorting in 