 users) and the count of logged-out contributors to a page.\";'),('en','messages:apihelp-query+deletedrevisions-example-revids','s:63:\"en:List the information for deleted revision <kbd>123456</kbd>.\";'),('en','messages:apihelp-query+deletedrevisions-example-titles','s:101:\"en:List the deleted revisions of the pages [[{{MediaWiki:Mainpage}}]] and its talk page with content.\";'),('en','messages:apihelp-query+deletedrevisions-extended-description','s:239:\"en:May be used in several ways:\n# Get deleted revisions for a set of pages, by setting titles or pageids. Ordered by title and timestamp.\n# Get data about a set of deleted revisions by setting their IDs with revids. Ordered by revision ID.\";'),('en','messages:apihelp-query+deletedrevisions-param-end','s:88:\"en:The timestamp to stop enumerating at. Ignored when processing a list of revision IDs.\";'),('en','messages:apihelp-query+deletedrevisions-param-excludeuser','s:37:\"en:Don\'t list revisions by this user.\";'),('en','messages:apihelp-query+deletedrevisions-param-start','s:91:\"en:The timestamp to start enumerating from. Ignored when processing a list of revision IDs.\";'),('en','messages:apihelp-query+deletedrevisions-param-tag','s:44:\"en:Only list revisions tagged with this tag.\";'),('en','messages:apihelp-query+deletedrevisions-param-user','s:36:\"en:Only list revisions by this user.\";'),('en','messages:apihelp-query+deletedrevisions-summary','s:36:\"en:Get deleted revision information.\";'),('en','messages:apihelp-query+deletedrevs-example-mode1','s:128:\"en:List the last deleted revisions of the pages [[{{MediaWiki:Mainpage}}]] and <kbd>Talk:Main Page</kbd>, with content (mode 1).\";'),('en','messages:apihelp-query+deletedrevs-example-mode2','s:69:\"en:List the last 50 deleted contributions by <kbd>Bob</kbd> (mode 2).\";'),('en','messages:apihelp-query+deletedrevs-example-mode3-main','s:70:\"en:List the first 50 deleted revisions in the main namespace (mode 3).\";'),('en','messages:apihelp-query+deletedrevs-example-mode3-talk','s:73:\"en:List the first 50 deleted pages in the {{ns:talk}} namespace (mode 3).\";'),('en','messages:apihelp-query+deletedrevs-extended-description','s:381:\"en:Operates in three modes:\n# List deleted revisions for the given titles, sorted by timestamp.\n# List deleted contributions for the given user, sorted by timestamp (no titles specified).\n# List all deleted revisions in the given namespace, sorted by title and timestamp (no titles specified, $1user not set).\n\nCertain parameters only apply to some modes and are ignored in others.\";'),('en','messages:apihelp-query+deletedrevs-param-end','s:40:\"en:The timestamp to stop enumerating at.\";'),('en','messages:apihelp-query+deletedrevs-param-excludeuser','s:37:\"en:Don\'t list revisions by this user.\";'),('en','messages:apihelp-query+deletedrevs-param-from','s:31:\"en:Start listing at this title.\";'),('en','messages:apihelp-query+deletedrevs-param-limit','s:98:\"en:The maximum amount of revisions to list. If <var>$2prop=content</var> is used, the limit is $1.\";'),('en','messages:apihelp-query+deletedrevs-param-namespace','s:37:\"en:Only list pages in this namespace.\";'),('en','messages:apihelp-query+deletedrevs-param-prefix','s:57:\"en:Search for all page titles that begin with this value.\";'),('en','messages:apihelp-query+deletedrevs-param-prop','s:27:\"en:Which properties to get:\";'),('en','messages:apihelp-query+deletedrevs-param-start','s:43:\"en:The timestamp to start enumerating from.\";'),('en','messages:apihelp-query+deletedrevs-param-tag','s:44:\"en:Only list revisions tagged with this tag.\";'),('en','messages:apihelp-query+deletedrevs-param-to','s:30:\"en:Stop listing at this title.\";'),('en','messages:apihelp-query+deletedrevs-param-unique','s:40:\"en:List only one revision for each page.\";'),('en','messages:apihelp-query+deletedrevs-param-user','s:36:\"en:Only list revisions by this user.\";'),('en','messages:apihelp-query+deletedrevs-paraminfo-modes','s:31:\