watchlist|preferences]]) to allow access to another user\'s watchlist.\";'),('en','messages:apihelp-query+watchlistraw-param-totitle','s:56:\"en:Title (with namespace prefix) to stop enumerating at.\";'),('en','messages:apihelp-query+watchlistraw-paramvalue-prop-changed','s:68:\"en:Adds timestamp of when the user was last notified about the edit.\";'),('en','messages:apihelp-query+watchlistraw-summary','s:49:\"en:Get all pages on the current user\'s watchlist.\";'),('en','messages:apihelp-query-example-allpages','s:59:\"en:Fetch revisions of pages beginning with <kbd>API/</kbd>.\";'),('en','messages:apihelp-query-example-revisions','s:134:\"en:Fetch [[Special:ApiHelp/query+siteinfo|site info]] and [[Special:ApiHelp/query+revisions|revisions]] of [[{{MediaWiki:Mainpage}}]].\";'),('en','messages:apihelp-query-extended-description','s:112:\"en:All data modifications will first have to use query to acquire a token to prevent abuse from malicious sites.\";'),('en','messages:apihelp-query-param-export','s:64:\"en:Export the current revisions of all given or generated pages.\";'),('en','messages:apihelp-query-param-exportnowrap','s:130:\"en:Return the export XML without wrapping it in an XML result (same format as [[Special:Export]]). Can only be used with $1export.\";'),('en','messages:apihelp-query-param-exportschema','s:109:\"en:Target the given version of the XML dump format when exporting. Can only be used with <var>$1export</var>.\";'),('en','messages:apihelp-query-param-indexpageids','s:71:\"en:Include an additional pageids section listing all returned page IDs.\";'),('en','messages:apihelp-query-param-iwurl','s:65:\"en:Whether to get the full URL if the title is an interwiki link.\";'),('en','messages:apihelp-query-param-list','s:22:\"en:Which lists to get.\";'),('en','messages:apihelp-query-param-meta','s:25:\"en:Which metadata to get.\";'),('en','messages:apihelp-query-param-prop','s:49:\"en:Which properties to get for the queried pages.\";'),('en','messages:apih