evisiondelete-param-reason','s:41:\"en:Reason for the deletion or undeletion.\";'),('en','messages:apihelp-revisiondelete-param-show','s:36:\"en:What to unhide for each revision.\";'),('en','messages:apihelp-revisiondelete-param-suppress','s:66:\"en:Whether to suppress data from administrators as well as others.\";'),('en','messages:apihelp-revisiondelete-param-tags','s:50:\"en:Tags to apply to the entry in the deletion log.\";'),('en','messages:apihelp-revisiondelete-param-target','s:66:\"en:Page title for the revision deletion, if required for the type.\";'),('en','messages:apihelp-revisiondelete-param-type','s:45:\"en:Type of revision deletion being performed.\";'),('en','messages:apihelp-revisiondelete-summary','s:33:\"en:Delete and undelete revisions.\";'),('en','messages:apihelp-rollback-example-simple','s:90:\"en:Roll back the last edits to page [[{{MediaWiki:Mainpage}}]] by user <kbd>Example</kbd>.\";'),('en','messages:apihelp-rollback-example-summary','s:189:\"en:Roll back the last edits to page [[{{MediaWiki:Mainpage}}]] by IP user <kbd>192.0.2.5</kbd> with summary <kbd>Reverting vandalism</kbd>, and mark those edits and the revert as bot edits.\";'),('en','messages:apihelp-rollback-extended-description','s:99:\"en:If the last user who edited the page made multiple edits in a row, they will all be rolled back.\";'),('en','messages:apihelp-rollback-param-markbot','s:55:\"en:Mark the reverted edits and the revert as bot edits.\";'),('en','messages:apihelp-rollback-param-pageid','s:85:\"en:Page ID of the page to roll back. Cannot be used together with <var>$1title</var>.\";'),('en','messages:apihelp-rollback-param-summary','s:63:\"en:Custom edit summary. If empty, default summary will be used.\";'),('en','messages:apihelp-rollback-param-tags','s:33:\"en:Tags to apply to the rollback.\";'),('en','messages:apihelp-rollback-param-title','s:84:\"en:Title of the page to roll back. Cannot be used together with <var>$1pageid</var>.\";'),('en','messages:apihelp-rollback-param-user','s:54:\"en:Name of the user whose edits are to be rolled back.\";'),('en','messages:apihelp-rollback-param-watchlist','s:140:\"en:Unconditionally add or remove the page from the current user\'s watchlist, use preferences (ignored for bot users) or do not change watch.\";'),('en','messages:apihelp-rollback-param-watchlistexpiry','s:98:\"en:Watchlist expiry timestamp. Omit this parameter entirely to leave the current expiry unchanged.\";'),('en','messages:apihelp-rollback-summary','s:34:\"en:Undo the last edit to the page.\";'),('en','messages:apihelp-rsd-example-simple','s:25:\"en:Export the RSD schema.\";'),('en','messages:apihelp-rsd-summary','s:50:\"en:Export an RSD (Really Simple Discovery) schema.\";'),('en','messages:apihelp-sanitize-mapdata-description','s:54:\"en:Performs data validation for Kartographer extension\";'),('en','messages:apihelp-sanitize-mapdata-example','s:26:\"en:Sanitize a GeoJSON blob\";'),('en','messages:apihelp-sanitize-mapdata-param-text','s:22:\"en:GeoJSON to sanitize\";'),('en','messages:apihelp-sanitize-mapdata-param-title','s:116:\"en:Title of page on which this GeoJSON is supposed to be located. If no title is provided, a dummy one will be used.\";'),('en','messages:apihelp-sanitize-mapdata-summary','s:54:\"en:Performs data validation for Kartographer extension\";'),('en','messages:apihelp-setnotificationtimestamp-example-all','s:58:\"en:Reset the notification status for the entire watchlist.\";'),('en','messages:apihelp-setnotificationtimestamp-example-allpages','s:83:\"en:Reset the notification status for pages in the <kbd>{{ns:user}}</kbd> namespace.\";'),('en','messages:apihelp-setnotificationtimestamp-example-page','s:64:\"en:Reset the notification status for [[{{MediaWiki:Mainpage}}]].\";'),('en','messages:apihelp-setnotificationtimestamp-example-pagetimestamp','s:112:\"en:Set the notification timestamp for [[{{MediaWiki:Mainpage}}]] so all edits since 1 January 2012 are unviewed.\";'),('en','messages:apihelp-setnotificationtimestamp-extended-description','s:171:\"en:This affects the highlighting of changed pages in the watchlist and history, and the sending of email when the \"{{int:tog-enotifwatchlistpages}}\" preference is enabled.\";'),('en','messages:apihelp-setnotificationtimestamp-param-entirewatchlist','s:29:\"en:Work on all watched pages.\";'),('en','messages:apihelp-setnotificationtimestamp-param-newerthanrevid','s:73:\"en:Revision to set the notification timestamp newer than (one page only).\";'),('en','messages:apihelp-setnotificationtimestamp-param-timestamp','s:56:\"en:Timestamp to which to set the notification timestamp.\";'),('en','messages:apihelp-setnotificationtimestamp-param-torevid','s:65:\"en:Revision to set the notification timestamp to (one page only).\";'),('en','messages:apihelp-setnotificationtimestamp-summary','s:55:\"en:Update the notification timestamp for watched pages.\";'),('en','messages:apihelp-setpagelanguage-example-default','s:86:\"en:Change the language of the page with ID 123 to the wiki\'s default content language.\";'),('en','messages:apihelp-setpagelanguage-example-language','s:72:\"en:Change the language of the page [[{{MediaWiki:Mainpage}}]] to Basque.\";'),('en','messages:apihelp-setpagelanguage-extended-description-disabled','s:177:\"en:Changing the language of a page is not allowed on this wiki.\n\nEnable <var>[[mw:Special:MyLanguage/Manual:$wgPageLanguageUseDB|$wgPageLanguageUseDB]]</var> to use this action.\";'),('en','messages:apihelp-setpagelanguage-param-lang','s:136:\"en:Language code of the language to change the page to. Use <kbd>default</kbd> to reset the page to the wiki\'s default content language.\";'),('en','messages:apihelp-setpagelanguage-param-pageid','s:106:\"en:Page ID of the page whose language you wish to change. Cannot be used together with <var>$1title</var>.\";'),('en','messages:apihelp-setpagelanguage-param-reason','s:25:\"en:Reason for the change.\";'),('en','messages:apihelp-setpagelanguage-param-tags','s:68:\"en:Change tags to apply to the log entry resulting from this action.\";'),('en','messages:apihelp-setpagelanguage-param-title','s:105:\"en:Title of the page whose language you wish to change. Cannot be used together with <var>$1pageid</var>.\";'),('en','messages:apihelp-setpagelanguage-summary','s:33:\"en:Change the language of a page.\";'),('en','messages:apihelp-smitespamanalyze-param-limit','s:47:\"en:SQL <code>LIMIT</code> for the list of pages\";'),('en','messages:apihelp-smitespamanalyze-param-offset','s:48:\"en:SQL <code>OFFSET</code> for the list of pages\";'),('en','messages:apihelp-smitespamanalyze-summary','s:62:\"en:Get a list of possible spam pages from Extension:SmiteSpam.\";'),('en','messages:apihelp-smitespamtrustuser-param-username','s:33:\"en:Username of the user to trust.\";'),('en','messages:apihelp-smitespamtrustuser-summary','s:68:\"en:Trust a user so that SmiteSpam ignores pages created by the user.\";'),('en','messages:apihelp-stashedit-extended-description','s:103:\"en:This is intended to be used via AJAX from the edit form to improve the performance of the page save.\";'),('en','messages:apihelp-stashedit-param-baserevid','s:36:\"en:Revision ID of the base revision.\";'),('en','messages:apihelp-stashedit-param-contentformat','s:56:\"en:Content serialization format used for the input text.\";'),('en','messages:apihelp-stashedit-param-contentmodel','s:36:\"en:Content model of the new content.\";'),('en','messages:apihelp-stashedit-param-section','s:90:\"en:Section identifier. <kbd>0</kbd> for the top section, <kbd>new</kbd> for a new section.\";'),('en','messages:apihelp-stashedit-param-sectiontitle','s:31:\"en:The title for a new section.\";'),('en','messages:apihelp-stashedit-param-stashedtexthash','s:55:\"en:Page content hash from a prior stash to use instead.\";'),('en','messages:apihelp-stashedit-param-summary','s:18:\"en:Change summary.\";'),('en','messages:apihelp-stashedit-param-text','s:16:\"en:Page content.\";'),('en','messages:apihelp-stashedit-param-title','s:34:\"en:Title of the page being edited.\";'),('en','messages:apihelp-stashedit-summary','s:35:\"en:Prepare an edit in shared cache.\";'),('en','messages:apihelp-summary','s:3:\"en:\";'),('en','messages:apihelp-tag-example-log','s:98:\"en:Remove the <kbd>spam</kbd> tag from log entry ID 123 with the reason <kbd>Wrongly applied</kbd>\";'),('en','messages:apihelp-tag-example-rev','s:82:\"en:Add the <kbd>vandalism</kbd> tag to revision ID 123 without specifying a reason\";'),('en','messages:apihelp-tag-param-add','s:56:\"en:Tags to add. Only manually defined tags can be added.\";'),('en','messages:apihelp-tag-param-logid','s:65:\"en:One or more log entry IDs from which to add or remove the tag.\";'),('en','messages:apihelp-tag-param-rcid','s:70:\"en:One or more recent changes IDs from which to add or remove the tag.\";'),('en','messages:apihelp-tag-param-reason','s:25:\"en:Reason for the change.\";'),('en','messages:apihelp-tag-param-remove','s:101:\"en:Tags to remove. Only tags that are either manually defined or completely undefined can be removed.\";'),('en','messages:apihelp-tag-param-revid','s:64:\"en:One or more revision IDs from which to add or remove the tag.\";'),('en','messages:apihelp-tag-param-tags','s:82:\"en:Tags to apply to the log entry that will be created as a result of this action.\";'),('en','messages:apihelp-tag-summary','s:70:\"en:Add or remove change tags from individual revisions or log entries.\";'),('en','messages:apihelp-unblock-example-id','s:36:\"en:Unblock block ID #<kbd>105</kbd>.\";'),('en','messages:apihelp-unblock-example-user','s:64:\"en:Unblock user <kbd>Bob</kbd> with reason <kbd>Sorry Bob</kbd>.\";'),('en','messages:apihelp-unblock-param-id','s:120:\"en:ID of the block to unblock (obtained through <kbd>list=blocks</kbd>). Cannot be used together with <var>$1user</var>.\";'),('en','messages:apihelp-unblock-param-reason','s:22:\"en:Reason for unblock.\";'),('en','messages:apihelp-unblock-param-tags','s:54:\"en:Change tags to apply to the entry in the block log.\";'),('en','messages:apihelp-unblock-param-user','s:65:\"en:User to unblock. Cannot be used together with <var>$1id</var>.\";'),('en','messages:apihelp-unblock-param-userid','s:52:\"en:Specify <kbd>$1user=#<var>ID</var></kbd> instead.\";'),('en','messages:apihelp-unblock-param-watchlistexpiry','s:98:\"en:Watchlist expiry timestamp. Omit this parameter entirely to leave the current expiry unchanged.\";'),('en','messages:apihelp-unblock-param-watchuser','s:56:\"en:Watch the user\'s or IP address\'s user and talk pages.\";'),('en','messages:apihelp-unblock-summary','s:18:\"en:Unblock a user.\";'),('en','messages:apihelp-undelete-example-page','s:44:\"en:Undelete page [[{{MediaWiki:Mainpage}}]].\";'),('en','messages:apihelp-undelete-example-revisions','s:61:\"en:Undelete two revisions of page [[{{MediaWiki:Mainpage}}]].\";'),('en','messages:apihelp-undelete-extended-description','s:256:\"en:A list of deleted revisions (including timestamps) can be retrieved through [[Special:ApiHelp/query+deletedrevisions|prop=deletedrevisions]], and a list of deleted file IDs can be retrieved through [[Special:ApiHelp/query+filearchive|list=filearchive]].\";'),('en','messages:apihelp-undelete-param-fileids','s:130:\"en:IDs of the file revisions to restore. If both <var>$1timestamps</var> and <var>$1fileids</var> are empty, all will be restored.\";'),('en','messages:apihelp-undelete-param-reason','s:24:\"en:Reason for restoring.\";'),('en','messages:apihelp-undelete-param-tags','s:57:\"en:Change tags to apply to the entry in the deletion log.\";'),('en','messages:apihelp-undelete-param-timestamps','s:134:\"en:Timestamps of the revisions to undelete. If both <var>$1timestamps</var> and <var>$1fileids</var> are empty, all will be undeleted.\";'),('en','messages:apihelp-undelete-param-title','s:33:\"en:Title of the page to undelete.\";'),('en','messages:apihelp-undelete-param-undeletetalk','s:62:\"en:Undelete all revisions of the associated talk page, if any.\";'),('en','messages:apihelp-undelete-param-watchlist','s:140:\"en:Unconditionally add or remove the page from the current user\'s watchlist, use preferences (ignored for bot users) or do not change watch.\";'),('en','messages:apihelp-undelete-param-watchlistexpiry','s:98:\"en:Watchlist expiry timestamp. Omit this parameter entirely to leave the current expiry unchanged.\";'),('en','messages:apihelp-undelete-summary','s:40:\"en:Undelete revisions of a deleted page.\";'),('en','messages:apihelp-unlinkaccount-example-simple','s:114:\"en:Attempt to remove the current user\'s link for the provider associated with <kbd>FooAuthenticationRequest</kbd>.\";'),('en','messages:apihelp-unlinkaccount-summary','s:61:\"en:Remove a linked third-party account from the current user.\";'),('en','messages:apihelp-upload-example-filekey','s:50:\"en:Complete an upload that failed due to warnings.\";'),('en','messages:apihelp-upload-example-url','s:21:\"en:Upload from a URL.\";'),('en','messages:apihelp-upload-extended-description','s:550:\"en:Several methods are available:\n* Upload file contents directly, using the <var>$1file</var> parameter.\n* Upload the file in pieces, using the <var>$1filesize</var>, <var>$1chunk</var>, and <var>$1offset</var> parameters.\n* Have the MediaWiki server fetch a file from a URL, using the <var>$1url</var> parameter.\n* Complete an earlier upload that failed due to warnings, using the <var>$1filekey</var> parameter.\nNote that the HTTP POST must be done as a file upload (i.e. using <code>multipart/form-data</code>) when sending the <var>$1file</var>.\";'),('en','messages:apihelp-upload-param-async','s:69:\"en:Make potentially large file operations asynchronous when possible.\";'),('en','messages:apihelp-upload-param-checkstatus','s:55:\"en:Only fetch the upload status for the given file key.\";'),('en','messages:apihelp-upload-param-chunk','s:18:\"en:Chunk contents.\";'),('en','messages:apihelp-upload-param-comment','s:106:\"en:Upload comment. Also used as the initial page text for new files if <var>$1text</var> is not specified.\";'),('en','messages:apihelp-upload-param-file','s:17:\"en:File contents.\";'),('en','messages:apihelp-upload-param-filekey','s:70:\"en:Key that identifies a previous upload that was stashed temporarily.\";'),('en','messages:apihelp-upload-param-filename','s:19:\"en:Target filename.\";'),('en','messages:apihelp-upload-param-filesize','s:29:\"en:Filesize of entire upload.\";'),('en','messages:apihelp-upload-param-ignorewarnings','s:23:\"en:Ignore any warnings.\";'),('en','messages:apihelp-upload-param-offset','s:28:\"en:Offset of chunk in bytes.\";'),('en','messages:apihelp-upload-param-sessionkey','s:60:\"en:Same as $1filekey, maintained for backward compatibility.\";'),('en','messages:apihelp-upload-param-stash','s:93:\"en:If set, the server will stash the file temporarily instead of adding it to the repository.\";'),('en','messages:apihelp-upload-param-tags','s:71:\"en:Change tags to apply to the upload log entry and file page revision.\";'),('en','messages:apihelp-upload-param-text','s:35:\"en:Initial page text for new files.\";'),('en','messages:apihelp-upload-param-url','s:30:\"en:URL to fetch the file from.\";'),('en','messages:apihelp-upload-param-watch','s:18:\"en:Watch the page.\";'),('en','messages:apihelp-upload-param-watchlist','s:140:\"en:Unconditionally add or remove the page from the current user\'s watchlist, use preferences (ignored for bot users) or do not change watch.\";'),('en','messages:apihelp-upload-param-watchlistexpiry','s:98:\"en:Watchlist expiry timestamp. Omit this parameter entirely to leave the current expiry unchanged.\";'),('en','messages:apihelp-upload-summary','s:55:\"en:Upload a file, or get the status of pending uploads.\";'),('en','messages:apihelp-userrights-example-expiry','s:75:\"en:Add user <kbd>SometimeSysop</kbd> to group <kbd>sysop</kbd> for 1 month.\";'),('en','messages:apihelp-userrights-example-user','s:121:\"en:Add user <kbd>FooBot</kbd> to group <kbd>bot</kbd>, and remove from groups <kbd>sysop</kbd> and <kbd>bureaucrat</kbd>.\";'),('en','messages:apihelp-userrights-example-userid','s:130:\"en:Add the user with ID <kbd>123</kbd> to group <kbd>bot</kbd>, and remove from groups <kbd>sysop</kbd> and <kbd>bureaucrat</kbd>.\";'),('en','messages:apihelp-userrights-param-add','s:118:\"en:Add the user to these groups, or if they are already a member, update the expiry of their membership in that group.\";'),('en','messages:apihelp-userrights-param-expiry','s:363:\"en:Expiry timestamps. May be relative (e.g. <kbd>5 months</kbd> or <kbd>2 weeks</kbd>) or absolute (e.g. <kbd>2014-09-18T12:34:56Z</kbd>). If only one timestamp is set, it will be used for all groups passed to the <var>$1add</var> parameter. Use <kbd>infinite</kbd>, <kbd>indefinite</kbd>, <kbd>infinity</kbd>, or <kbd>never</kbd> for a never-expiring user group.\";'),('en','messages:apihelp-userrights-param-reason','s:25:\"en:Reason for the change.\";'),('en','messages:apihelp-userrights-param-remove','s:37:\"en:Remove the user from these groups.\";'),('en','messages:apihelp-userrights-param-tags','s:60:\"en:Change tags to apply to the entry in the user rights log.\";'),('en','messages:apihelp-userrights-param-user','s:8:\"en:User.\";'),('en','messages:apihelp-userrights-param-userid','s:52:\"en:Specify <kbd>$1user=#<var>ID</var></kbd> instead.\";'),('en','messages:apihelp-userrights-param-watchlistexpiry','s:98:\"en:Watchlist expiry timestamp. Omit this parameter entirely to leave the current expiry unchanged.\";'),('en','messages:apihelp-userrights-param-watchuser','s:40:\"en:Watch the user\'s user and talk pages.\";'),('en','messages:apihelp-userrights-summary','s:36:\"en:Change a user\'s group membership.\";'),('en','messages:apihelp-validatepassword-example-1','s:64:\"en:Validate the password <kbd>foobar</kbd> for the current user.\";'),('en','messages:apihelp-validatepassword-example-2','s:80:\"en:Validate the password <kbd>qwerty</kbd> for creating user <kbd>Example</kbd>.\";'),('en','messages:apihelp-validatepassword-extended-description','s:209:\"en:Validity is reported as <samp>Good</samp> if the password is acceptable, <samp>Change</samp> if the password may be used for login but must be changed, or <samp>Invalid</samp> if the password is not usable.\";'),('en','messages:apihelp-validatepassword-param-email','s:56:\"en:Email address, for use when testing account creation.\";'),('en','messages:apihelp-validatepassword-param-password','s:24:\"en:Password to validate.\";'),('en','messages:apihelp-validatepassword-param-realname','s:52:\"en:Real name, for use when testing account creation.\";'),('en','messages:apihelp-validatepassword-param-user','s:82:\"en:Username, for use when testing account creation. The named user must not exist.\";'),('en','messages:apihelp-validatepassword-summary','s:60:\"en:Validate a password against the wiki\'s password policies.\";'),('en','messages:apihelp-visualeditor-param-badetag','s:90:\"en:If RESTBase query returned a seemingly invalid ETag, pass it here for logging purposes.\";'),('en','messages:apihelp-visualeditor-param-basetimestamp','s:105:\"en:When saving, set this to the timestamp of the revision that was edited. Used to detect edit conflicts.\";'),('en','messages:apihelp-visualeditor-param-cachekey','s:113:\"en:For serialize or diff, use the result of a previous serializeforcache request with this key. Overrides $1html.\";'),('en','messages:apihelp-visualeditor-param-editintro','s:32:\"en:Edit intro to add to notices.\";'),('en','messages:apihelp-visualeditor-param-etag','s:16:\"en:ETag to send.\";'),('en','messages:apihelp-visualeditor-param-format','s:28:\"en:The format of the output.\";'),('en','messages:apihelp-visualeditor-param-html','s:50:\"en:HTML to send to Parsoid to convert to wikitext.\";'),('en','messages:apihelp-visualeditor-param-oldid','s:60:\"en:The revision number to use (defaults to latest revision).\";'),('en','messages:apihelp-visualeditor-param-paction','s:21:\"en:Action to perform.\";'),('en','messages:apihelp-visualeditor-param-page','s:34:\"en:The page to perform actions on.\";'),('en','messages:apihelp-visualeditor-param-preload','s:71:\"en:The page to use content from if the fetched page has no content yet.\";'),('en','messages:apihelp-visualeditor-param-preloadparams','s:62:\"en:Parameters to substitute into the preload page, if present.\";'),('en','messages:apihelp-visualeditor-param-pst','s:84:\"en:Pre-save transform wikitext before sending it to Parsoid (paction=parsefragment).\";'),('en','messages:apihelp-visualeditor-param-section','s:31:\"en:The section on which to act.\";'),('en','messages:apihelp-visualeditor-param-starttimestamp','s:101:\"en:When saving, set this to the timestamp of when the page was loaded. Used to detect edit conflicts.\";'),('en','messages:apihelp-visualeditor-param-stash','s:66:\"en:When saving, set this true if you want to use the stashing API.\";'),('en','messages:apihelp-visualeditor-param-wikitext','s:74:\"en:Wikitext to send to Parsoid to convert to HTML (paction=parsefragment).\";'),('en','messages:apihelp-visualeditor-summary','s:53:\"en:Returns HTML5 for a page from the Parsoid service.\";'),('en','messages:apihelp-visualeditoredit-param-basetimestamp','s:105:\"en:When saving, set this to the timestamp of the revision that was edited. Used to detect edit conflicts.\";'),('en','messages:apihelp-visualeditoredit-param-cachekey','s:90:\"en:Use the result of a previous serializeforcache request with this key. Overrides $1html.\";'),('en','messages:apihelp-visualeditoredit-param-captchaid','s:52:\"en:Captcha ID (when saving with a captcha response).\";'),('en','messages:apihelp-visualeditoredit-param-captchaword','s:63:\"en:Answer to the captcha (when saving with a captcha response).\";'),('en','messages:apihelp-visualeditoredit-param-data-{plugin}','s:56:\"en:Arbitrary data sent by a plugin with the API request.\";'),('en