oes not provide access to any rights that your user account would not otherwise have. See the [[Special:ListGrants|table of grants]] for more information.\n\nRisky grants are marked. Unmarked grants are generally hard to abuse when the bot is hijacked by someone with malicious intent. Grants with vandalism risk (<span class=\"mw-grantriskgroup-vandalism\">{{int:grantriskgroup-vandalism}}</span>) can be used to cause disruption that takes a lot of effort to clean up. Grants with security risk (<span class=\"mw-grantriskgroup-security\">{{int:grantriskgroup-security}}</span>) can cause lasting harm (such as theft of private data). Internal grants (<span class=\"mw-grantriskgroup-internal\">{{int:grantriskgroup-internal}}</span>) are typically used only by the site operator. Please do not request risky grants unless you really need them.\";'),('en','messages:botpasswords-insert-failed','s:53:\"en:Failed to add bot name \"$1\". Was it already added?\";'),('en','messages:botpasswords-invalid-name','s:77:\"en:The username specified does not contain the bot password separator (\"$1\").\";'),('en','messages:botpasswords-label-appid','s:12:\"en:Bot name:\";'),('en','messages:botpasswords-label-cancel','s:9:\"en:Cancel\";'),('en','messages:botpasswords-label-create','s:9:\"en:Create\";'),('en','messages:botpasswords-label-delete','s:9:\"en:Delete\";'),('en','messages:botpasswords-label-grants','s:21:\"en:Applicable grants:\";'),('en','messages:botpasswords-label-grants-column','s:10:\"en:Granted\";'),('en','messages:botpasswords-label-needsreset','s:25:\"en:(password needs reset)\";'),('en','messages:botpasswords-label-resetpassword','s:21:\"en:Reset the password\";'),('en','messages:botpasswords-label-update','s:9:\"en:Update\";'),('en','messages:botpasswords-locked','s:66:\"en:You cannot login with a bot password as your account is locked.\";'),('en','messages:botpasswords-needs-reset','s:79:\"en:The bot password for bot name \"$2\" of {{GENDER:$1|user}} \"$1\" must be rese