ification failed due to internal error: $1\";'),('en','messages:captcha-help','s:27:\"en:Solution of the CAPTCHA.\";'),('en','messages:captcha-id-help','s:44:\"en:This value should be sent back unchanged.\";'),('en','messages:captcha-id-label','s:13:\"en:CAPTCHA ID\";'),('en','messages:captcha-info-help','s:30:\"en:Description of the CAPTCHA.\";'),('en','messages:captcha-ip-whitelist','s:4:\"en:-\";'),('en','messages:captcha-label','s:10:\"en:CAPTCHA\";'),('en','messages:captcha-sendemail','s:172:\"en:To protect the wiki against automated spamming, we kindly ask you to solve the following task below and enter the answer in the box ([[Special:Captcha/help|more info]]):\";'),('en','messages:captcha-sendemail-fail','s:32:\"en:Incorrect or missing CAPTCHA.\";'),('en','messages:captchahelp-cookies-needed','s:74:\"en:You will need to have cookies enabled in your browser for this to work.\";'),('en','messages:captchahelp-text','s:933:\"en:Websites that accept postings from the public, like this wiki, are often abused by spammers who use automated tools to post their links to many sites.\nWhile these spam links can be removed, they are a significant nuisance.\n\nSometimes, especially when adding new web links to a page, the wiki may show you an image of colored or distorted text and ask you to type the words shown.\nSince this is a task that\'s hard to automate, it will allow most real humans to make their posts while stopping most spammers and other robotic attackers.\n\nUnfortunately, this may inconvenience users with limited vision or those using text-based or speech-based browsers.\nAt the moment, we do not have an audio alternative available.\nPlease contact the [[Special:ListAdmins|site administrators]] for assistance if this is unexpectedly preventing you from making legitimate actions.\n\nHit the \"back\" button in your browser to return to the page editor.\";'),('en','messages:captchahelp-title','s:15:\"en:CAPTCHA help\";'),('en','messages:cascadeprotected','s:185: