rd: $2\n\nFor security reasons you will need to change your password on first login.\nTo login, please go to {{fullurl:Special:UserLogin}}.\";'),('en','messages:confirmaccount-email-body2','s:231:\"en:Your request for an account has been approved on {{SITENAME}}.\n\nAccount name: $1\n\nPassword: $2\n\n$3\n\nFor security reasons you will need to change your password on first login.\nTo login, please go to {{fullurl:Special:UserLogin}}.\";'),('en','messages:confirmaccount-email-body3','s:371:\"en:Sorry, your request for an account \"$1\" has been rejected on {{SITENAME}}.\n\nThere are several ways this can happen.\nYou may not have filled out the form correctly, did not provide adequate length in your responses, or otherwise failed to meet some policy criteria.\nThere may be contact lists on site that you can use if you want to know more about user account policy.\";'),('en','messages:confirmaccount-email-body4','s:186:\"en:Sorry, your request for an account \"$1\" has been rejected on {{SITENAME}}.\n\n$2\n\nThere may be contact lists on site that you can use if you want to know more about user account policy.\";'),('en','messages:confirmaccount-email-body5','s:235:\"en:Before your request for an account \"$1\" can be accepted on {{SITENAME}} you must first provide some additional information.\n\n$2\n\nThere may be contact lists on site that you can use if you want to know more about user account policy.\";'),('en','messages:confirmaccount-email-q','s:8:\"en:Email\";'),('en','messages:confirmaccount-email-subj','s:31:\"en:{{SITENAME}} account request\";'),('en','messages:confirmaccount-extensionname','s:24:\"en:Confirm User Accounts\";'),('en','messages:confirmaccount-held','s:65:\"en:({{GENDER:$1|marked}} \"on hold\" by [[User:$1|$1]] on $3 at $4)\";'),('en','messages:confirmaccount-hold','s:7:\"en:Hold\";'),('en','messages:confirmaccount-ip','s:14:\"en:IP address:\";'),('en','messages:confirmaccount-leg-areas','s:25:\"en:Main areas of interest\";'),('en','messages:confirmaccount-leg-ip','s:18:\"en:IP address data\";'),('en','messages:confirmaccount-leg-other','s:20:\"en:Other information\";'),('en','messages:confirmaccount-leg-person','s:23:\"en:Personal information\";'),('en','messages:confirmaccount-leg-user','s:15:\"en:User account\";'),('en','messages:confirmaccount-legend','s:30:\"en:Confirm/reject this account\";'),('en','messages:confirmaccount-list','s:135:\"en:Below is a list of account requests awaiting approval.\nOnce a request is either approved or rejected it will removed from this list.\";'),('en','messages:confirmaccount-list2','s:235:\"en:Below is a list recently rejected account requests which may automatically be deleted once several days old.\nThey can still be approved into accounts, though you may want to first consult the rejecting administrator before doing so.\";'),('en','messages:confirmaccount-list3','s:143:\"en:Below is a list expired account requests which may automatically be deleted once several days old.\nThey can still be approved into accounts.\";'),('en','messages:confirmaccount-maintext','s:547:\"en:\'\'\'This page is used to confirm pending account requests at \'\'{{SITENAME}}\'\'\'\'\'.\n\nEach account request queue consists of three subqueues.\nOne for open request, one for those that have been put on hold by other administrators pending further information, and another for recently rejected requests.\n\nWhen responding to a request, carefully review it and, if needed, confirm the information contain therein.\nYour actions will be privately logged.\nYou are also expected to review any activity that takes place here aside from what you do yourself.\";'),('en','messages:confirmaccount-mismatched','s:62:\"en:This field must match that of the original account request.\";'),('en','messages:confirmaccount-mismatched-general','s:134:\"en:An override was requested on a field of the original account request that is not allowed or the \"mail password\" option was not set.\";'),('en','messages:confir