our browser:\n\n$3\n\nIf you did *not* register the account, follow this link\nto cancel the email address confirmation:\n\n$5\n\nThis confirmation code will expire at $4.\";'),('en','messages:confirmemail_body_changed','s:415:\"en:Someone, probably you, from IP address $1,\nhas changed the email address of the account \"$2\" to this address on {{SITENAME}}.\n\nTo confirm that this account really does belong to you and reactivate\nemail features on {{SITENAME}}, open this link in your browser:\n\n$3\n\nIf the account does *not* belong to you, follow this link\nto cancel the email address confirmation:\n\n$5\n\nThis confirmation code will expire at $4.\";'),('en','messages:confirmemail_body_set','s:409:\"en:Someone, probably you, from IP address $1,\nhas set the email address of the account \"$2\" to this address on {{SITENAME}}.\n\nTo confirm that this account really does belong to you and activate\nemail features on {{SITENAME}}, open this link in your browser:\n\n$3\n\nIf the account does *not* belong to you, follow this link\nto cancel the email address confirmation:\n\n$5\n\nThis confirmation code will expire at $4.\";'),('en','messages:confirmemail_invalid','s:56:\"en:Invalid confirmation code.\nThe code may have expired.\";'),('en','messages:confirmemail_invalid_format','s:117:\"en:Invalid confirmation code.\nCheck your email, the confirmation link might have been truncated by your email client.\";'),('en','messages:confirmemail_invalidated','s:38:\"en:Email address confirmation canceled\";'),('en','messages:confirmemail_loggedin','s:45:\"en:Your email address has now been confirmed.\";'),('en','messages:confirmemail_needlogin','s:43:\"en:Please $1 to confirm your email address.\";'),('en','messages:confirmemail_noemail','s:94:\"en:You do not have a valid email address set in your [[Special:Preferences|user preferences]].\";'),('en','messages:confirmemail_oncreate','s:177:\"en:A confirmation code was sent to your email address.\nThis code is not required to lo