ut','s:9:\"en:Result\";'),('en','messages:expand_templates_preview','s:10:\"en:Preview\";'),('en','messages:expand_templates_preview_fail_html','s:380:\"en:<em>Because {{SITENAME}} has raw HTML enabled and there was a loss of session data, the preview is hidden as a precaution against JavaScript attacks.</em>\n\n<strong>If this is a legitimate preview attempt, please try again.</strong>\nIf it still does not work, try [[Special:UserLogout|logging out]] and logging back in, and check that your browser allows cookies from this site.\";'),('en','messages:expand_templates_preview_fail_html_anon','s:256:\"en:<em>Because {{SITENAME}} has raw HTML enabled and you are not logged in, the preview is hidden as a precaution against JavaScript attacks.</em>\n\n<strong>If this is a legitimate preview attempt, please [[Special:UserLogin|log in]] and try again.</strong>\";'),('en','messages:expand_templates_remove_comments','s:18:\"en:Remove comments\";'),('en','messages:expand_templates_remove_nowiki','s:35:\"en:Suppress <nowiki> tags in result\";'),('en','messages:expand_templates_title','s:45:\"en:Context title, for {{FULLPAGENAME}}, etc.:\";'),('en','messages:expand_templates_xml_output','s:13:\"en:XML output\";'),('en','messages:expandtemplates','s:19:\"en:Expand templates\";'),('en','messages:expansion-depth-exceeded-category','s:42:\"en:Pages where expansion depth is exceeded\";'),('en','messages:expansion-depth-exceeded-category-desc','s:48:\"en:The page exceeds the maximum expansion depth.\";'),('en','messages:expansion-depth-exceeded-warning','s:36:\"en:Page exceeded the expansion depth\";'),('en','messages:expensive-parserfunction-category','s:54:\"en:Pages with too many expensive parser function calls\";'),('en','messages:expensive-parserfunction-category-desc','s:217:\"en:The page uses too many expensive parser functions (like <code>#ifexist</code>). See [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:$wgExpensiveParserFunctionLimit Manual:$wgExpensiveParserFunctionLimit].\";'),('en','messages:expensive-parserfunction-warning','s:197:\"en:<strong>Warning:</strong> This page contains too many expensive parser function calls.\n\nIt should have less than $2 {{PLURAL:$2|call|calls}}, there {{PLURAL:$1|is now $1 call|are now $1 calls}}.\";'),('en','messages:explainconflict','s:334:\"en:Someone else has changed this page since you started editing it.\nThe upper text area contains the page text as it currently exists.\nYour changes are shown in the lower text area.\nYou will have to merge your changes into the existing text.\n<strong>Only</strong> the text in the upper text area will be published when you press \"$1\".\";'),('en','messages:export','s:15:\"en:Export pages\";'),('en','messages:export-addcat','s:6:\"en:Add\";'),('en','messages:export-addcattext','s:27:\"en:Add pages from category:\";'),('en','messages:export-addns','s:6:\"en:Add\";'),('en','messages:export-addnstext','s:28:\"en:Add pages from namespace:\";'),('en','messages:export-download','s:15:\"en:Save as file\";'),('en','messages:export-manual','s:22:\"en:Add pages manually:\";'),('en','messages:export-pagelinks','s:38:\"en:Include linked pages to a depth of:\";'),('en','messages:export-submit','s:9:\"en:Export\";'),('en','messages:export-summary','s:3:\"en:\";'),('en','messages:export-templates','s:20:\"en:Include templates\";'),('en','messages:exportall','s:19:\"en:Export all pages\";'),('en','messages:exportcuronly','s:58:\"en:Include only the current revision, not the full history\";'),('en','messages:exportlistauthors','s:52:\"en:Include a full list of contributors for each page\";'),('en','messages:exportnohistory','s:130:\"en:----\n<strong>Note:</strong> Exporting the full history of pages through this form has been disabled due to performance reasons.\";'),('en','messages:exporttext','s:591:\"en:You can export the text and editing history of a particular page or set of pages wrapped in some XML.\nThis can be imported into another wiki using MediaWiki via the [[Special:Import|import page]].\n\nTo export pages, enter the titles in the text box below, one title per line, and select whether you want the current revision as well as all old revisions, with the page history lines, or the current revision with the info about the last edit.\n\nIn the latter case you can also use a link, for example [[{{#Special:Export}}/{{MediaWiki:Mainpage}}]] for the page \"[[{{MediaWiki:Mainpage}}]]\".\";'),('en','messages:external_image_whitelist','s:443:\"en: #Leave this line exactly as it is<pre>\n#Put regular expression fragments (just the part that goes between the //) below\n#These will be matched with the URLs of external (hotlinked) images\n#Those that match will be displayed as images, otherwise only a link to the image will be shown\n#Lines beginning with # are treated as comments\n#This is case-insensitive\n\n#Put all regex fragments above this line. Leave this line exactly as it is</pre>\";'),('en','messages:externaldberror','s:108:\"en:There was either an authentication database error or you are not allowed to update your external account.\";'),('en','messages:faq','s:6:\"en:FAQ\";'),('en','messages:fatalpassworderror','s:110:\"en:$1\n\nFor security reasons, you cannot log in with this password. Please [$2 request a password reset email].\";'),('en','messages:feb','s:6:\"en:Feb\";'),('en','messages:february','s:11:\"en:February\";'),('en','messages:february-gen','s:11:\"en:February\";'),('en','messages:feed-atom','s:7:\"en:Atom\";'),('en','messages:feed-invalid','s:34:\"en:Invalid subscription feed type.\";'),('en','messages:feed-rss','s:6:\"en:RSS\";'),('en','messages:feed-unavailable','s:38:\"en:Syndication feeds are not available\";'),('en','messages:feedback-cancel','s:9:\"en:Cancel\";'),('en','messages:feedback-close','s:7:\"en:Done\";'),('en','messages:feedback-dialog-intro','s:130:\"en:You can use the easy form below to submit your feedback. Your comment will be added to the page \"$1\", along with your username.\