m Barnstar\";'),('en','messages:wikilove-barnstar-brilliant-desc','s:124:\"en:The Brilliant Idea Barnstar is awarded to a user who figures out an elegant solution to a particularly difficult problem.\";'),('en','messages:wikilove-barnstar-brilliant-option','s:26:\"en:Brilliant Idea Barnstar\";'),('en','messages:wikilove-barnstar-brilliant-title','s:30:\"en:The Brilliant Idea Barnstar\";'),('en','messages:wikilove-barnstar-citation-desc','s:123:\"en:The Citation Barnstar is awarded to users who provide references and in-line citations to previously unsourced articles.\";'),('en','messages:wikilove-barnstar-citation-option','s:20:\"en:Citation Barnstar\";'),('en','messages:wikilove-barnstar-citation-title','s:24:\"en:The Citation Barnstar\";'),('en','messages:wikilove-barnstar-civility-desc','s:122:\"en:The Civility Barnstar is awarded to any user who excels at maintaining civility in the midst of contentious situations.\";'),('en','messages:wikilove-barnstar-civility-option','s:20:\"en:Civility Barnstar\";'),('en','messages:wikilove-barnstar-civility-title','s:24:\"en:The Civility Barnstar\";'),('en','messages:wikilove-barnstar-copyeditor-desc','s:118:\"en:The Copyeditor\'s Barnstar is awarded for excellence in correcting spelling, grammar, punctuation, and style issues.\";'),('en','messages:wikilove-barnstar-copyeditor-option','s:24:\"en:Copyeditor\'s Barnstar\";'),('en','messages:wikilove-barnstar-copyeditor-title','s:28:\"en:The Copyeditor\'s Barnstar\";'),('en','messages:wikilove-barnstar-defender-desc','s:143:\"en:The Defender of the Wiki is awarded to those who have gone above and beyond to prevent {{SITENAME}} from being used for fraudulent purposes.\";'),('en','messages:wikilove-barnstar-defender-option','s:32:\"en:Defender of the Wiki Barnstar\";'),('en','messages:wikilove-barnstar-defender-title','s:36:\"en:The Defender of the Wiki Barnstar\";'),('en','messages:wikilove-barnstar-designers-desc','s:132:\"en:The Graphic Designer\'s Barnstar is awarded to thos