pped nuts and sweetened with syrup or honey.\";'),('en','messages:wikilove-food-baklava-header','s:24:\"en:Some baklava for you!\";'),('en','messages:wikilove-food-baklava-option','s:10:\"en:Baklava\";'),('en','messages:wikilove-food-beer-desc','s:139:\"en:Beer is the world\'s most widely consumed and probably oldest alcoholic beverage. It is the third most popular drink after water and tea.\";'),('en','messages:wikilove-food-beer-header','s:18:\"en:A beer for you!\";'),('en','messages:wikilove-food-beer-option','s:7:\"en:Beer\";'),('en','messages:wikilove-food-brownie-desc','s:115:\"en:A brownie is a flat, baked treat made of dense, rich chocolate cake. They are usually served as squares or bars.\";'),('en','messages:wikilove-food-brownie-header','s:21:\"en:A brownie for you!\";'),('en','messages:wikilove-food-brownie-option','s:10:\"en:Brownie\";'),('en','messages:wikilove-food-bubbletea-desc','s:174:\"en:Bubble tea is a tea or juice beverage containing small chewy balls made of tapioca starch or jelly. First invented in Taiwan, it is now popular in many areas of the world.\";'),('en','messages:wikilove-food-bubbletea-header','s:27:\"en:Some bubble tea for you!\";'),('en','messages:wikilove-food-bubbletea-option','s:13:\"en:Bubble tea\";'),('en','messages:wikilove-food-cheeseburger-desc','s:132:\"en:A staple of diners and fast-food restaurants, cheeseburgers were first popularized in the United States during the 1920s and 30s.\";'),('en','messages:wikilove-food-cheeseburger-header','s:26:\"en:A cheeseburger for you!\";'),('en','messages:wikilove-food-cheeseburger-option','s:15:\"en:Cheeseburger\";'),('en','messages:wikilove-food-coffee-desc','s:87:\"en:Appreciated all over the world, coffee is known for its energizing effect on people.\";'),('en','messages:wikilove-food-coffee-header','s:27:\"en:A cup of coffee for you!\";'),('en','messages:wikilove-food-coffee-option','s:16:\"en:Cup of coffee\";'),('en','messages:wikilove-food-cookie-desc','s:120:\"en:Cookies (known as biscuits in the UK) are small baked treats that come in a wide array of flavors, shapes, and sizes.\";'),('en','messages:wikilove-food-cookie-header','s:20:\"en:A cookie for you!\";'),('en','messages:wikilove-food-cookie-option','s:9:\"en:Cookie\";'),('en','messages:wikilove-food-cupcake-desc','s:116:\"en:A cupcake is a small cake designed to serve one person. They are often served with frosting and sprinkles on top.\";'),('en','messages:wikilove-food-cupcake-header','s:21:\"en:A cupcake for you!\";'),('en','messages:wikilove-food-cupcake-option','s:10:\"en:Cupcake\";'),('en','messages:wikilove-food-pie-desc','s:143:\"en:Pies can be filled with a wide variety of sweet or savory ingredients. Popular varieties include apple, cherry, peach, chocolate, and pecan.\";'),('en','messages:wikilove-food-pie-header','s:17:\"en:A pie for you!\";'),('en','messages:wikilove-food-pie-option','s:6:\"en:Pie\";'),('en','messages:wikilove-food-select','s:29:\"en:Select food or drink item:\";'),('en','messages:wikilove-food-strawberries-desc','s:155:\"en:The strawberry fruit (which is not actually a berry) is widely appreciated for its characteristic aroma, bright red color, juicy texture, and sweetness.\";'),('en','messages:wikilove-food-strawberries-header','s:34:\"en:A bowl of strawberries for you!\";'),('en','messages:wikilove-food-strawberries-option','s:15:\"en:Strawberries\";'),('en','messages:wikilove-food-stroopwafels-desc','s:124:\"en:A stroopwafel is a Dutch snack made from two thin layers of baked batter with a caramel-like syrup filling in the middle.\";'),('en','messages:wikilove-food-stroopwafels-header','s:29:\"en:Some stroopwafels for you!\";'),('en','messages:wikilove-food-stroopwafels-option','s:15:\"en:Stroopwafels\";'),('en','messages:wikilove-food-tea-desc','s:121:\"en:After water, tea is the most widely consumed beverage in the world. It can be enjoyed hot or cold, with milk or sugar.\";'),('en','messages:wikilove-food-tea-header','s:24:\"en:A cup of tea f