://lists.wikimedia.org/mailman/listinfo/mediawiki-announce MediaWiki release mailing list]\n* [https://www.mediawiki.org/wiki/Special:MyLanguage/Localisation#Translation_resources Localise MediaWiki for your language]\n* [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:Combating_spam Learn how to combat spam on your wiki]','utf-8'),(11,'<strong>Welcome to MuizenWiki.</strong>\n\nThis is [https://muizenmesh.co.za | The MuizenMesh Project] very own wikipedia\n\nWhere you may discover useful resources on our open-source, appropriate technology, yoga and surfing community\n\nConsult the [https://www.mediawiki.org/wiki/Special:MyLanguage/Help:Contents User\'s Guide] for information on using the wiki software.\n\n<inputbox>\ntype=create\nwidth=100\nbreak=no\nbuttonlabel=Create new article\ndefault=(Article title)\n</inputbox>\n\n==Pages==\n\n\n\n== Getting started ==\n* [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:Configuration_settings Configuration settings list]\n* [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:FAQ MediaWiki FAQ]\n* [https://lists.wikimedia.org/mailman/listinfo/mediawiki-announce MediaWiki release mailing list]\n* [https://www.mediawiki.org/wiki/Special:MyLanguage/Localisation#Translation_resources Localise MediaWiki for your language]\n* [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:Combating_spam Learn how to combat spam on your wiki]','utf-8'),(12,'You can add your name if wish to participate in the group purchase and group build to the section below. \n\nThis an open source, modular PCB battery holder which can be printed via JLCPCB, that merely requires a simple addition of a Battery Management System (BMS). \n\nThere are some pre-built examples available to purchase also via AliExpress. \n\nI know it may seem a bit nuts or formidable and intimidating if you haven\'t soldered anything before, but believe me its relatively simple and a lot easier than building ones own Arduino clone. \n\nReasons why one would want to build your own battery is because its modular, and a lot more affordable than investing in a retail UPS. \n\nAdded bonus is that you can work towards stabilising your home grid during loadshedding, at very least you\'ll pick up some skills, learn from your mistakes and having something positive to do instead of whining during 15 years of loadshedding.\n\n==Group Build==\n\n[[David Robert Lewis]] 20 PCBs','utf-8'),(13,'<strong>Welcome to MuizenWiki.</strong>\n\nThis is [https://muizenmesh.co.za | The MuizenMesh Project] very own wikipedia\n\nWhere you may discover useful resources on our open-source, appropriate technology, yoga and surfing community\n\nConsult the [https://www.mediawiki.org/wiki/Special:MyLanguage/Help:Contents User\'s Guide] for information on using the wiki software.\n\n<inputbox>\ntype=create\nwidth=100\nbreak=no\nbuttonlabel=Create new article\ndefault=(Article title)\n</inputbox>\n\n==Pages==\n[[MECC 18650 Battery Project]]\n\n== Getting started ==\n* [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:Configuration_settings Configuration settings list]\n* [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:FAQ MediaWiki FAQ]\n* [https://lists.wikimedia.org/mailman/listinfo/mediawiki-announce MediaWiki release mailing list]\n* [https://www.mediawiki.org/wiki/Special:MyLanguage/Localisation#Translation_resources Localise MediaWiki for your language]\n* [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:Combating_spam Learn how to combat spam on your wiki]','utf-8'),(14,'Please add your name below if wish to participate in the group purchase and group build to the section Group Build \n\nThis an open source, modular PCB battery holder based upon a WebLearning project which can be printed via JLCPCB, that merely requires a simple addition of a Battery Management System (BMS). \n\nThere are some pre-built examples available to purchase also via AliExpress. \n\nI know it may seem a bit nuts or formidable and intimidating if you haven\'t soldered anything before, but believe me its relatively simple and a lot easier than building ones own Arduino clone. \n\nReasons why one would want to build your own battery is because its modular, and a lot more affordable than investing in a retail UPS. \n\nAdded bonus is that you can work towards stabilising your home grid during loadshedding, at very least you\'ll pick up some skills, learn from your mistakes and having something positive to do instead of whining during 15 years of loadshedding.\n\n==Group Build==\n\n[[David Robert Lewis]] 20 PCBs','utf-8'),(15,'Please add your name below if wish to participate in the group purchase and group build to the section Group Build \n\nThis an open source, modular PCB battery holder based upon a [https://oshwlab.com/Weblearning/7s-battery-holder WebLearning project which can be printed via JLCPCB], that merely requires a simple addition of a Battery Management System (BMS). \n\nThere are some pre-built examples available to purchase also via AliExpress. \n\nI know it may seem a bit nuts or formidable and intimidating if you haven\'t soldered anything before, but believe me its relatively simple and a lot easier than building ones own Arduino clone. \n\nReasons why one would want to build your own battery is because its modular, and a lot more affordable than investing in a retail UPS. \n\nAdded bonus is that you can work towards stabilising your home grid during loadshedding, at very least you\'ll pick up some skills, learn from your mistakes and having something positive to do instead of whining during 15 years of loadshedding.\n\n==Group Build==\n\n[[David Robert Lewis]] 20 PCBs','utf-8'),(16,'Please add your name below if wish to participate in the group purchase and group build to the section Group Build \n\nThis an open source, modular PCB battery holder based upon a [https://oshwlab.com/Weblearning/7s-battery-holder WebLearning project which can be printed via JLCPCB], that merely requires a simple addition of a Battery Management System (BMS). \n\nThere are some pre-built examples available to purchase also via AliExpress. \n\nI know it may seem a bit nuts or formidable and intimidating if you haven\'t soldered anything before, but believe me its relatively simple and a whole lot easier than building ones own Arduino clone. \n\nReasons why one would want to build your own battery is because its modular, and a lot more affordable than investing in a retail UPS. \n\nAdded bonus is that you can work towards stabilising your home grid during loadshedding, at very least you\'ll pick up some skills, learn from your mistakes and having something positive to do instead of whining during 15 years of loadshedding.\n\n==Group Build==\n\n[[David Robert Lewis]] 20 PCBs','utf-8'),(17,'Please add your name below if wish to participate in the \'\'\'group purchase and group build\'\'\' to the section Group Build \n\nThis an open source, modular PCB battery holder based upon a [https://oshwlab.com/Weblearning/7s-battery-holder WebLearning project which can be printed via JLCPCB], which is based upon [https://jag35.com/products/7s-pcb-boards-unpopulated Jehu\'s project] that merely requires a simple addition of a Battery Management System (BMS). \n\nThe module uses the 3.6v 18650 battery and holds 7 batteries and thus produces 25.2v. You would need 10 of them to produce 250+ volts. Most of your appliances are rated 220-250v. You can easily step-down if you need. \n\nThere are some pre-built examples available to purchase also via AliExpress. \n\nI know it may seem a bit nuts or formidable and intimidating if you haven\'t soldered anything before, but believe me its relatively simple and a whole lot easier than building ones own Arduino clone. \n\nReasons why one would want to build your own battery is because its modular, and a lot more affordable than investing in a retail UPS. \n\nAdded bonus is that you can work towards stabilising your home grid during loadshedding, at very least you\'ll pick up some skills, learn from your mistakes and having something positive to do instead of whining during 15 years of loadshedding.\n\n==Group Build==\n\n[[David Robert Lewis]] 20 PCBs','utf-8'),(18,'Please add your name below if wish to participate in the \'\'\'group purchase and group build\'\'\' to the section Group Build \n\nThis an open source, modular PCB battery holder based upon a [https://oshwlab.com/Weblearning/7s-battery-holder WebLearning project which can be printed via JLCPCB], which is based upon [https://jag35.com/products/7s-pcb-boards-unpopulated Jehu\'s project] that merely requires a simple addition of a Battery Management System (BMS). \n\nThe module uses the 3.6v 18650 battery and holds 7 batteries in series and thus produces 25.2v. You would need 10 of them to produce 250+ volts. Most of your appliances are rated 220-250v. You can easily step-down if you need. \n\nThere are some pre-built examples available to purchase also via AliExpress. \n\nI know it may seem a bit nuts or formidable and intimidating if you haven\'t soldered anything before, but believe me its relatively simple and a whole lot easier than building ones own Arduino clone. \n\nReasons why one would want to build your own battery is because its modular, and a lot more affordable than investing in a retail UPS. \n\nAdded bonus is that you can work towards stabilising your home grid during loadshedding, at very least you\'ll pick up some skills, learn from your mistakes and having something positive to do instead of whining during 15 years of loadshedding.\n\n==Group Build==\n\n[[David Robert Lewis]] 20 PCBs','utf-8'),(19,'Please add your name below if wish to participate in the \'\'\'group purchase and group build\'\'\' to the section Group Build \n\nThis an open source, modular PCB battery holder based upon a [https://oshwlab.com/Weblearning/7s-battery-holder WebLearning project which can be printed via JLCPCB], which is based upon [https://jag35.com/products/7s-pcb-boards-unpopulated Jehu\'s project] that merely requires a simple addition of a Battery Management System (BMS). \n\nThe module uses the 3.6v 18650 battery and holds 7 batteries in series and thus produces 25.2v. You would need 10 of them to produce 250+ volts. Most of your appliances are rated 220-250v. You can easily step-down if you need. \n\nThere are some [https://www.aliexpress.com/item/1005003426672705.html?gatewayAdapt=4itemAdapt pre-built examples available to purchase also via AliExpress]. \n\nI know it may seem a bit nuts or formidable and intimidating if you haven\'t soldered anything before, but believe me its relatively simple and a whole lot easier than building ones own Arduino clone. \n\nReasons why one would want to build your own battery is because its modular, and a lot more affordable than investing in a retail UPS. \n\nAdded bonus is that you can work towards stabilising your home grid during loadshedding, at very least you\'ll pick up some skills, learn from your mistakes and having something positive to do instead of whining during 15 years of loadshedding.\n\n==Group Build==\n\n[[David Robert Lewis]] 20 PCBs','utf-8'),(20,'Please add your name below if wish to participate in the \'\'\'group purchase and group build\'\'\' to the section Group Build \n\nThis an open source, modular PCB battery holder based upon a [https://oshwlab.com/Weblearning/7s-battery-holder WebLearning project which can be printed via JLCPCB], which is based upon [https://jag35.com/products/7s-pcb-boards-unpopulated Jehu\'s project] that merely requires a simple addition of a Battery Management System (BMS). \n\nThe module uses the 3.6v 18650 battery and holds 7 batteries in series and thus produces 25.2v. You would need 10 of them to produce 250+ volts. Most of your appliances are rated 220-250v. You can easily step-down if you need. \n\nThere are some [https://www.aliexpress.com/item/1005003426672705.html?gatewayAdapt=4itemAdapt pre-built examples available to purchase also via AliExpress]. \n\nI know it may seem a bit nuts, or formidable and intimidating, if you haven\'t soldered anything before, but believe me its relatively simple and a whole lot easier than building your own Arduino clone. \n\nReasons why one would want to build your own home storage battery is because its modular, and a lot more affordable than investing in a retail UPS. \n\nAdded bonus is that you can work towards stabilising your home grid during loadshedding, at very least you\'ll pick up some skills, learn from your mistakes and have something positive to do instead of whining during the next 15 years of loadshedding.\n\n==Group Build==\n\n[[David Robert Lewis]] 20 PCBs','utf-8'),(21,'Please add your name below if wish to participate in the \'\'\'group purchase and group build\'\'\' to the section Group Build \n\nThis an open source, modular PCB battery holder based upon a [https://oshwlab.com/Weblearning/7s-battery-holder WebLearning project which can be printed via JLCPCB], which is based upon [https://jag35.com/products/7s-pcb-boards-unpopulated Jehu\'s project] that merely requires a simple addition of a Battery Management System (BMS). \n\nThe module uses the 3.6v 18650 battery and holds 7 batteries in series and thus produces 25.2v. You would need 10 of them to produce 250+ volts. Most of your appliances are rated 220-250v. You can easily step-down if you need. \n\nThere are some [https://www.aliexpress.com/item/1005003426672705.html?gatewayAdapt=4itemAdapt pre-built examples available to purchase also via AliExpress]. \n\nI know it may seem a bit nuts, or formidable and intimidating, if you haven\'t soldered anything before, but believe me its relatively simple and a whole lot easier than building your own Arduino clone. \n\nReasons why one would want to build your own home storage battery is because its modular, and a lot more affordable than investing in a retail UPS. \n\nAdded bonus is that you can work towards stabilising your home grid during loadshedding, at very least you\'ll pick up some skills, learn from your mistakes and have something positive to do instead of whining during the next 15 years of loadshedding.\n\nI\'ll have the costs and Bill of Materials (BOM) set out as soon as the information is available. In the meantime, express yourself.\n\n==Group Build==\n\n\'\'\'name                       amount\'\'\'\n\n[[David Robert Lewis]] 20 PCBs','utf-8'),(22,'<strong>Welcome to MuizenWiki.</strong>\n\nThis is [https://muizenmesh.co.za | The MuizenMesh Project] very own wikipedia\n\nWhere you may discover useful resources on our open-source software, appropriate technology,  and the yoga and surfing community\n\nConsult the [https://www.mediawiki.org/wiki/Special:MyLanguage/Help:Contents User\'s Guide] for information on using the wiki software.\n\n<inputbox>\ntype=create\nwidth=100\nbreak=no\nbuttonlabel=Create new article\ndefault=(Article title)\n</inputbox>\n\n==Pages==\n[[MECC 18650 Battery Project]]\n\n== Getting started ==\n* [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:Configuration_settings Configuration settings list]\n* [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:FAQ MediaWiki FAQ]\n* [https://lists.wikimedia.org/mailman/listinfo/mediawiki-announce MediaWiki release mailing list]\n* [https://www.mediawiki.org/wiki/Special:MyLanguage/Localisation#Translation_resources Localise MediaWiki for your language]\n* [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:Combating_spam Learn how to combat spam on your wiki]','utf-8'),(23,'I live, work, hack and make music in Muizenberg. \n\nBeach yoga, playing guitar, looking after my kids while I write for Medialternatives, my other project.','utf-8'),(24,'Please add your name below if wish to participate in the \'\'\'group purchase and group build\'\'\' to the section Group Build. Its also recommended to register first so that we can contact you. \n\nThis an open source, modular PCB battery holder based upon a [https://oshwlab.com/Weblearning/7s-battery-holder WebLearning project which can be printed via JLCPCB], which is based upon [https://jag35.com/products/7s-pcb-boards-unpopulated Jehu\'s project] that merely requires a simple addition of a Battery Management System (BMS). \n\nThe module uses the 3.6v 18650 battery and holds 7 batteries in series and thus produces 25.2v. You would need 10 of them to produce 250+ volts. Most of your appliances are rated 220-250v. You can easily step-down if you need. \n\nThere are some [https://www.aliexpress.com/item/1005003426672705.html?gatewayAdapt=4itemAdapt pre-built examples available to purchase also via AliExpress]. \n\nI know it may seem a bit nuts, or formidable and intimidating, if you haven\'t soldered anything before, but believe me its relatively simple and a whole lot easier than building your own Arduino clone. \n\nReasons why one would want to build your own home storage battery is because its modular, and a lot more affordable than investing in a retail UPS. \n\nAdded bonus is that you can work towards stabilising your home grid during loadshedding, at very least you\'ll pick up some skills, learn from your mistakes and have something positive to do instead of whining during the next 15 years of loadshedding.\n\nI\'ll have the costs and Bill of Materials (BOM) set out as soon as the information is available. In the meantime, express yourself.\n\n==Group Build==\n\n\'\'\'name                       amount\'\'\'\n\n[[David Robert Lewis]] 20 PCBs','utf-8'),(25,'Please add your name below if wish to participate in the \'\'\'group purchase and group build\'\'\' to the section Group Build. Its also recommended to register first so that we can contact you. \n\nThis an open source, modular PCB battery holder based upon a [https://oshwlab.com/Weblearning/7s-battery-holder WebLearning project which can be printed via JLCPCB], which is based upon [https://jag35.com/products/7s-pcb-boards-unpopulated Jehu\'s project] th