ct] very own wikipedia\n\nWhere you may discover useful resources on our open-source software, appropriate technology,  and the yoga and surfing community\n\nConsult the [https://www.mediawiki.org/wiki/Special:MyLanguage/Help:Contents User\'s Guide] for information on using the wiki software.\n\n<inputbox>\ntype=create\nwidth=100\nbreak=no\nbuttonlabel=Create new article\ndefault=(Article title)\n</inputbox>\n\n{{#display_map:center=False Bay, Cape Town, South Africa}}\n\n==Pages==\n[[Muizenberg Energy Cooperative]]\n\n[[MECC 18650 Battery Project]]\n\n== Getting started ==\n* [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:Configuration_settings Configuration settings list]\n* [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:FAQ MediaWiki FAQ]\n* [https://lists.wikimedia.org/mailman/listinfo/mediawiki-announce MediaWiki release mailing list]\n* [https://www.mediawiki.org/wiki/Special:MyLanguage/Localisation#Translation_resources Localise MediaWiki for your language]\n* [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:Combating_spam Learn how to combat spam on your wiki]','utf-8'),(48,'This is the MuizenWiki home of Muizenberg Energy Cooperative\n\n{{#display_map:center=Muizenberg Beach, Cape Town, South Africa}}\n[[Category:CBO]]\n[[Category:Meeting Minutes]]','utf-8'),(49,'','utf-8'),(50,'This is the MuizenWiki home of Muizenberg Energy Cooperative\n\n{{#display_map:center=Muizenberg Beach, Cape Town, South Africa}}[[Meeting Minutes]]\n[[Category:CBO]]\n[[Category:Meeting Minutes]]','utf-8'),(51,'￼￼[[The MECC’s 2nd Meeting￼￼ (6 February 2023)]]\n\n[[￼￼The MECC’s 3rd Meeting￼￼ (15 February 2023)]]\n\n[[The MECC’s 4th Meeting￼￼ (20 February 2023)]]','utf-8'),(52,'\'\'\'PLACE :\'\'\' Muiz Kitchen, 150 Main rd Muizenberg\n\n\'\'\'DATE\'\'\' : 6 February 2023\n\n\'\'\'Present\'\'\' : David (ad hoc chairman), Chad, Joah, Kevin, Gareth.\n\n\n\'\'\'Points covered :\'\'\'\n\nAlternate Plan : Virtual power stations (solar) feeding into grid,\n\nthis with blockchain accounting and a self-minited crypto-coin for local distribution.\n\nAlternate Batteries : Briefly discussed lead-acid (car) and sodium-ion\n\n\n\'\'\'We also talked around :\'\'\'\n\nEconomy of scale regarding PCB-boards and batteries.\n\nBattery management\n\nPrototyping\n\nCreating awareness (cartoon)\n\nEducation\n\n\n\n\'\'\'Things to Do :\'\'\'\n\nWe need both a certified electrician and someone with civil legal knowledge to form a decent board / committee.\n\nWe need to crunch some numbers around prices and scale.\n\n\n\n\'\'\'Next Meeting :\'\'\'\n\n13 February 2023 6PM – 7:30PM\n\nMuiz Kitchen, 150 Main rd Muizenberg\n\n__NOINDEX__\n[[Category:Meetings]]','utf-8'),(53,'\'\'\'PLACE :\'\'\' Muiz Kitchen, 150 Main rd Muizenberg\n\n\'\'\'DATE\'\'\' : 6 February 2023\n\n\'\'\'Present\'\'\' : David (ad hoc chairman), Chad, Joah, Kevin, Gareth.\n\n\n\'\'\'Points covered :\'\'\'\n\nAlternate Plan : Virtual power stations (solar) feeding into grid,\n\nthis with blockchain accounting and a self-minited crypto-coin for local distribution.\n\nAlternate Batteries : Briefly discussed lead-acid (car) and sodium-ion\n\n\n\'\'\'We also talked around :\'\'\'\n\nEconomy of scale regarding PCB-boards and batteries.\n\nBattery management\n\nPrototyping\n\nCreating awareness (cartoon)\n\nEducation\n\n\n\n\'\'\'Things to Do :\'\'\'\n\nWe need both a certified electrician and someone with civil legal knowledge to form a decent board / committee.\n\nWe need to crunch some numbers around prices and scale.\n\n\n\n\'\'\'Next Meeting :\'\'\'\n\n13 February 2023 6PM – 7:30PM\n\nMuiz Kitchen, 150 Main rd Muizenberg\n\n__NOINDEX__\n[[Category:Meeting Minutes]]','utf-8'),(54,'\'\'\'PLACE :\'\'\' Muiz Kitchen, 150 Main rd Muizenberg\n\n\'\'\'DATE\'\'\' : 15 February 2023\n\n\'\'\'Present :\'\'\' David (ad hoc chairman), Chad, Joah, Kevin, Gareth.\n\n\nJoah had to leave early unfortunately but he had done some research and sourced 18650 batteries at less than R30 each new, which works out near R2100 for a battery module. Ten of these in parallel should provide around 5Kw.\n\nThere is a draft Memorandum Of Understanding, (attached below) this is intended to be a living document that is it may be amended as needed.\n\nWe had a discussion and watched a video around Printed Circuit Boards (PCB), a bit of a trade off between buying in bulk and needing to proto-type.\n\nWe also discussed Battery Management Systems (BMS) which also has a similar trade off the the PCBs\n\nTalked around batteries, from the video above, new batteries bought in bulk – from the same batch – should be mostly OK, 2nd hand batteries need to be tested and sorted into stocks of similar capacitance & resistance.\n\nWe also discussed around the idea of a specialised installed plug to connect directly into the DB board as well as the potential of a battery economy re-charging the batteries similar to re-filling gas bottles.\n\nWe also mentioned the need for a timelime/roadmap and milestones to keep ourselves on track.\n\n\n[https://drive.google.com/file/d/1IA5Ag--eKaExDLv_JXRSx2JvPwuRWk-m/view?usp=sharing MECC MOU]\n\n[[Category:Meeting Minutes]]','utf-8'),(55,'\'\'\'PLACE :\'\'\' Muiz Kitchen, 150 Main rd Muizenberg\n\n\'\'\'DATE\'\'\' : 20 February 2023\n\n\'\'\'Present :\'\'\' David (ad hoc chairman), Chad, Joah, Gareth.\n\n\n\nStarted off with signing the [https://drive.google.com/file/d/1IA5Ag--eKaExDLv_JXRSx2JvPwuRWk-m/view?usp=sharing MOU] ,\n\nWe then moved on to a discussion around fundraising, we decided on a R50 per month membership fee and an initial R450 deposit for those wishing to engage in the battery build. We also mentioned the Muizenberg Market as a testing platform for a working prototype in order to raise interest as well as putting the word out more and converting those who showed interested on [https://www.facebook.com/groups/890884558995990/ FaceBook] into members.\n\nWe discussed a questionnaire similar to a FAQ in order to solidify our motives and methods, Chad has since drafted the questions which David has answered, this can be found here.   [https://drive.google.com/file/d/1E05KjTjR_8ZgdFihpmc1EbO5MYDkFDZ0/view?usp=sharing Questionnaire]\n\nWe also talked around forming a co-op and will access the relevant documents and if needed legal advice.\n\nWe then moved on to talk about the battery build specifically the battery holder PDB which David has ordered.\n\nWe also watched a video around a different type of battery build using a pre-punched nickle sheet to weld the batteries in place.\n\nThe boards David has ordered only cover the battery holder, we will still need to deal with the battery management system (BMS), the inverter, heat monitoring and dissipation etc. \n\n[[Category:Meeting Minutes]]','utf-8'),(56,'[[The MECC’s 2nd Meeting￼￼ (6 February 2023)]]\n\n[[The MECC’s 3rd Meeting￼￼ (15 February 2023)]]\n\n[[The MECC’s 4th Meeting￼￼ (20 February 2023)]]','utf-8'),(57,'[[The MECC’s 2nd Meeting (6 February 2023)]]\n\n[[The MECC’s 3rd Meeting (15 February 2023)]]\n\n[[The MECC’s 4th Meeting (20 February 2023)]]','utf-8'),(58,'#REDIRECT [[The MECC’s 2nd Meeting￼￼ (6 February 2023)]]','utf-8'),(59,'\'\'\'PLACE :\'\'\' Muiz Kitchen, 150 Main rd Muizenberg\n\n\'\'\'DATE\'\'\' : 15 February 2023\n\n\'\'\'Present :\'\'\' David (ad hoc chairman), Chad, Joah, Kevin, Gareth.\n\n\nJoah had to leave early unfortunately but he had done some research and sourced 18650 batteries at less than R30 each new, which works out near R2100 for a battery module. Ten of these in parallel should provide around 5Kw.\n\nThere is a draft Memorandum Of Understanding, (attached below) this is intended to be a living document that is it may be amended as needed.\n\nWe had a discussion and watched a video around Printed Circuit Boards (PCB), a bit of a trade off between buying in bulk and needing to proto-type.\n\nWe also discussed Battery Management Systems (BMS) which also has a similar trade off the the PCBs\n\nTalked around batteries, from the video above, new batteries bought in bulk – from the same batch – should be mostly OK, 2nd hand batteries need to be tested and sorted into stocks of similar capacitance & resistance.\n\nWe also discussed around the idea of a specialised installed plug to connect directly into the DB board as well as the potential of a battery economy re-charging the batteries similar to re-filling gas bottles.\n\nWe also mentioned the need for a timelime/roadmap and milestones to keep ourselves on track.\n\n\n[https://drive.google.com/file/d/1IA5Ag--eKaExDLv_JXRSx2JvPwuRWk-m/view?usp=sharing MECC MOU]\n\n[[Category:Meeting Minutes]]\n{{DEFAULTSORT:The_MECC’s_3rd_Meeting￼￼_(15_February_2023)}}','utf-8'),(60,'\'\'\'PLACE :\'\'\' Muiz Kitchen, 150 Main rd Muizenberg\n\n\'\'\'DATE\'\'\' : 20 February 2023\n\n\'\'\'Present :\'\'\' David (ad hoc chairman), Chad, Joah, Gareth.\n\n\n\nStarted off with signing the [https://drive.google.com/file/d/1IA5Ag--eKaExDLv_JXRSx2JvPwuRWk-m/view?usp=sharing MOU] ,\n\nWe then moved on to a discussion around fundraising, we decided on a R50 per month membership fee and an initial R450 deposit for those wishing to engage in the battery build. We also mentioned the Muizenberg Market as a testing platform for a working prototype in order to raise interest as well as putting the word out more and converting those who showed interested on [https://www.facebook.com/groups/890884558995990/ FaceBook] into members.\n\nWe discussed a questionnaire similar to a FAQ in order to solidify our motives and methods, Chad has since drafted the questions which David has answered, this can be found here.   [https://drive.google.com/file/d/1E05KjTjR_8ZgdFihpmc1EbO5MYDkFDZ0/view?usp=sharing Questionnaire]\n\nWe also talked around forming a co-op and will access the relevant documents and if needed legal advice.\n\nWe then moved on to talk about the battery build specifically the battery holder PDB which David has ordered.\n\nWe also watched a video around a different type of battery build using a pre-punched nickle sheet to weld the batteries in place.\n\nThe boards David has ordered only cover the battery holder, we will still need to deal with the battery management system (BMS), the inverter, heat monitoring and dissipation etc. \n\n[[Category:Meeting Minutes]]\n{{DEFAULTSORT:4th_Meeting￼￼_(20_February_2023)}}','utf-8'),(61,'\'\'\'PLACE :\'\'\' Muiz Kitchen, 150 Main rd Muizenberg\n\n\'\'\'DATE\'\'\' : 20 February 2023\n\n\'\'\'Present :\'\'\' David (ad hoc chairman), Chad, Joah, Gareth.\n\n\n\nStarted off with signing the [https://drive.google.com/file/d/1IA5Ag--eKaExDLv_JXRSx2JvPwuRWk-m/view?usp=sharing MOU] ,\n\nWe then moved on to a discussion around fundraising, we decided on a R50 per month membership fee and an initial R450 deposit for those wishing to engage in the battery build. We also mentioned the Muizenberg Market as a testing platform for a working prototype in order to raise interest as well as putting the word out more and converting those who showed interested on [https://www.facebook.com/groups/890884558995990/ FaceBook] into members.\n\nWe discussed a questionnaire similar to a FAQ in order to solidify our motives and methods, Chad has since drafted the questions which David has answered, this can be found here.   [https://drive.google.com/file/d/1E05KjTjR_8ZgdFihpmc1EbO5MYDkFDZ0/view?usp=sharing Questionnaire]\n\nWe also talked around forming a co-op and will access the relevant documents and if needed legal advice.\n\nWe then moved on to talk about the battery build specifically the battery holder PDB which David has ordered.\n\nWe also watched a video around a different type of battery build using a pre-punched nickle sheet to weld the batteries in place.\n\nThe boards David has ordered only cover the battery holder, we will still need to deal with the battery management system (BMS), the inverter, heat monitoring and dissipation etc. \n\n[[Category:Meeting Minutes]]\n{{DEFAULTSORT:The MECC’s 4th Meeting￼￼ (20 February 2023)}}','utf-8'),(62,'\'\'\'PLACE :\'\'\' Muiz Kitchen, 150 Main rd Muizenberg\n\n\'\'\'DATE\'\'\' : 20 February 2023\n\n\'\'\'Present :\'\'\' David (ad hoc chairman), Chad, Joah, Gareth.\n\n\n\nStarted off with signing the [https://drive.google.com/file/d/1IA5Ag--eKaExDLv_JXRSx2JvPwuRWk-m/view?usp=sharing MOU] ,\n\nWe then moved on to a discussion around fundraising, we decided on a R50 per month membership fee and an initial R450 deposit for those wishing to engage in the battery build. We also mentioned the Muizenberg Market as a testing platform for a working prototype in order to raise interest as well as putting the word out more and converting those who showed interested on [https://www.facebook.com/groups/890884558995990/ FaceBook] into members.\n\nWe discussed a questionnaire similar to a FAQ in order to solidify our motives and methods, Chad has since drafted the questions which David has answered, this can be found here.   [https://drive.google.com/file/d/1E05KjTjR_8ZgdFihpmc1EbO5MYDkFDZ0/view?usp=sharing Questionnaire]\n\nWe also talked around forming a co-op and will access the relevant documents and if needed legal advice.\n\nWe then moved on to talk about the battery build specifically the battery holder PDB which David has ordered.\n\nWe also watched a video around a different type of battery build using a pre-punched nickle sheet to weld the batteries in place.\n\nThe boards David has ordered only cover the battery holder, we will still need to deal with the battery management system (BMS), the inverter, heat monitoring and dissipation etc. \n\n[[Category:Meeting Minutes]]\n{{DEFAULTSORT:T4}}','utf-8'),(63,'\'\'\'PLACE :\'\'\' Muiz Kitchen, 150 Main rd Muizenberg\n\n\'\'\'DATE\'\'\' : 6 February 2023\n\n\'\'\'Present\'\'\' : David (ad hoc chairman), Chad, Joah, Kevin, Gareth.\n\n\n\'\'\'Points covered :\'\'\'\n\nAlternate Plan : Virtual power stations (solar) feeding into grid,\n\nthis with blockchain accounting and a self-minited crypto-coin for local distribution.\n\nAlternate Batteries : Briefly discussed lead-acid (car) and sodium-ion\n\n\n\'\'\'We also talked around :\'\'\'\n\nEconomy of scale regarding PCB-boards and batteries.\n\nBattery management\n\nPrototyping\n\nCreating awareness (cartoon)\n\nEducation\n\n\n\n\'\'\'Things to Do :\'\'\'\n\nWe need both a certified electrician and someone with civil legal knowledge to form a decent board / committee.\n\nWe need to crunch some numbers around prices and scale.\n\n\n\n\'\'\'Next Meeting :\'\'\'\n\n13 February 2023 6PM – 7:30PM\n\nMuiz Kitchen, 150 Main rd Muizenberg\n\n__NOINDEX__\n[[Category:Meeting Minutes]]\n{{DEFAULTSORT:T2}}','utf-8'),(64,'\'\'\'PLACE :\'\'\' Muiz Kitchen, 150 Main rd Muizenberg\n\n\'\'\'DATE\'\'\' : 15 February 2023\n\n\'\'\'Present :\'\'\' David (ad hoc chairman), Chad, Joah, Kevin, Gareth.\n\n\nJoah had to leave early unfortunately but he had done some research and sourced 18650 batteries at less than R30 each new, which works out near R2100 for a battery module. Ten of these in parallel should provide around 5Kw.\n\nThere is a draft Memorandum Of Understanding, (attached below) this is intended to be a living document that is it may be amended as needed.\n\nWe had a discussion and watched a video around Printed Circuit Boards (PCB), a bit of a trade off between buying in bulk and needing to proto-type.\n\nWe also discussed Battery Management Systems (BMS) which also has a similar trade off the the PCBs\n\nTalked around batteries, from the video above, new batteries bought in bulk – from the same batch – should be mostly OK, 2nd hand batteries need to be tested and sorted into stocks of similar capacitance & resistance.\n\nWe also discussed around the idea of a specialised installed plug to connect directly into the DB board as well as the potential of a battery economy re-charging the batteries similar to re-filling gas bottles.\n\nWe also mentioned the need for a timelime/roadmap and milestones to keep ourselves on track.\n\n\n[https://drive.google.com/file/d/1IA5Ag--eKaExDLv_JXRSx2JvPwuRWk-m/view?usp=sharing MECC MOU]\n\n[[Category:Meeting Minutes]]\n{{DEFAULTSORT:T3}}','utf-8'),(65,'#REDIRECT [[The MECC’s 4th Meeting￼￼ (20 February 2023)]]','utf-8'),(66,'#REDIRECT [[￼￼The MECC’s 3rd Meeting￼￼ (15 February 2023)]]','utf-8'),(67,'  \nPlease add your name below if wish to participate in the \'\'\'group purchase and group build\'\'\' to the section Group Build. Its also recommended to register first so that we can contact you. \n\n\n==Project A 3s 12v module==\nBased on Makermans 12v S4 18Ah Modular battery pack with removable cells from 18650 cells salvaged from old laptop batteries. \'I made a these pcbs for the Power modules, where there are glass fuses to show if any cell is shorted and can be easily serviced. \'\n\n{| class=\"wikitable\"\n|+\n!Cells\n!Configuration\n!Voltage\n|-\n|3\n|Series\n|3x3.7=11.1v\n|}\n==Video 3s 12V module ==\n<embedvideo service=\"youtube\">https://youtu.be/MeOZUStC238</embedvideo>\n==Project B 25v 7s module==\nThis is an open source, modular PCB battery holder, based upon a [https://oshwlab.com/Weblearning/7s-battery-holder WebLearning project which can be printed via JLCPCB], which is based upon [https://jag35.com/products/7s-pcb-boards-unpopulated Jehu\'s project] that merely requires a simple addition of a Battery Management System (BMS). \n\nThe module uses the 3.6v 18650 battery and holds 7 batteries in series and thus produces 25.2v. You would need 10 of them to produce 250+ volts. Most of your appliances are rated 220-250v. You can easily step-down if you need. \n\nThere are some [https://www.aliexpress.com/item/1005003426672705.html?gatewayAdapt=4itemAdapt pre-built examples available to purchase also via AliExpress]. \n\nI know it may seem a bit nuts, or formidable and intimidating, if you haven\'t soldered anything before, but believe me its relatively simple and a whole lot easier than building your own Arduino clone. \n\nReasons why one would want to build your own home storage battery is because its modular, and a lot more affordable than investing in a retail UPS. \n\nAdded bonus is that you can work towards stabilising your home grid during loadshedding, at very least you\'ll pick up some skills, learn from your mistakes and have something positive to do instead of whining during the next 15 years of loadshedding.\n\nI\'ll have the costs to the [https://oshwlab.com/Weblearning/7s-battery-holder Bill of Materials (BOM)] set out as soon as the information is available. In the meantime, express yourself.\n{| class=\"wikitable\"\n|+\n!Cells\n!Configuration\n! Voltage \n|-\n|7\n| Series \n|7x3.7=25.9v\n|}\n\n==Video 7s module ==\n<embedvideo service=\"youtube\">https://youtu.be/fL6ugOUgtiU</embedvideo>\n\n==Video BMS modules ==\n\n<embedvideo service=\"youtube\">https://youtu.be/rT-1gvkFj60</embedvideo>\n\n==Group Build==\n\n\'\'\'name                       amount       type\'\'\'\n\n[[David Robert Lewis]] 10 x A 10 x B','utf-8'),(69,'HUuuv~0X(/E75$3/]AL-54RX36+\ZUqzCS\ZLJ2\ZjP/V0EV`d\0','utf-8,gzip'),(70,'USn0+xL[h\0gZ-u4@q__ʞIҋo!ZnV+|1b}Ŏdh\Z^=\\\\7dDŧyA(S,؀qeC7m?]QGAB	{c.>ny,(,px\n\0ݾf&6;V\0儁Ga)Kg/3tVWV_ћ-(XرO%}#\\?/:#6p2$2 d? Ӽc(3LkLD[7NCP#Ip\'M5\'GZLc3h7j{oaUʈi>5{3x.nx2E/yՠ#s4,\rQ{u,QZT#Ǟ\'u\ZΧ=f򮺒wc~u(<T5059t%,Ǽ\rՄĲ,j+8n>RpZSP\"JY~DÒXZ*q>)*:\',+0YoT}rY}uԣN{o5bx] SPlw3~ܜ6\0','utf-8,gzip'),(71,'USKo0WnpP-Ma[Kh(Au}tdr7_L&eg7ˆ|\'DA̰C LR!N>\rB|d\rK(E!E&MQ(;ABq{]ϲ,[EHp\rDr]\"%C5Mh2Z%jc$ݰ3$*a\"@Su%b\"؃\rm!=9[6}ңo}1R9B%\'R4Ƙ]\0\0\Z=Ɩ$5FZqRPo\nNb\Z+véت(,	y1fGrpzj\'@>$> \Ztd$#xS((!DtZl:HRJ@-C[iyOs^K]u%/:IR?)nPKj`*aѪ++a<F7,Dr0]DUtz\nS:;t7R/diYFZ^*}({S,zU\'$1ڕt4G +8у5AoT!}`	m7GThoٍFs<G2u\nYnFOI47Q,CH5r/ϻ/','utf-8,gzip'),(72,'TMk@ȡ8Vrh)\n&I1% X\ZI۬v|ʮ[FH3yTi:``#y/l{,Īwۆ`,˺1#NK3}DxUK%ʙT\r`z\r=Z$\nqӒ#L/\rATG$F71=:\0Zu+Ff\0 